(6, 1, 'Departamento estilo frances', 'd jke bde fs fghj egfhj segfhje gsehj gfhjse fghjse gfhjse fghjes fgjhse gfjhse gfhj sgefjh seghjf gsehj fghjse gfhjse gfhjse gfhj seghjf gshje gfehs gfhjseg fhjse gfhjse fghjse gfhjse gfhjse gfhjse gfhjs gha ghw evwg evh g due duegsjfgsjefv seg dsehsfs.', NULL, NULL, 5, 2, 0, 180, 20, 20, 10, '222 Avenida Presidente Manuel Quintana', 'CABA', 'Buenos Aires', 'Argentina', '-58.38711120000001', '-34.5906113', 0.00, NULL, 'flexible', NULL, 4, 31, 0, '2017-04-26 00:19:39', '2017-05-25 20:23:33', NULL, 0),
(18, 6, 'Casona de arquitectura colonial', 'Experimentar un evento con luz natural, un inmenso jardín con árboles de antaño, galería con vista a la ribera y aromas de estancia a media hora de ciudad autónoma de Buenos Aires. Su cocina creativa propone un diferencial en la exploración de sensaciones en la que se sumerge el espectador.<br />\n<br />\nZona: San Isidro<br />\n<br />\nTemporada baja (Junio, Julio y Agosto): 20% de descuento.', NULL, NULL, 4, 4, 0, 680, 200, 200, 100, 'Anchorena 477', 'Buenos Aires', 'San Isidro', 'Argentina', '-58.50923599999999', '-34.4668418', 0.00, NULL, 'estricto', NULL, 6, 1, 0, '2017-05-03 18:02:03', '2017-07-21 20:28:34', NULL, 1),
(21, 7, 'Emblemática galería de estilo industrial', 'En pleno casco histórico, se encuentra esta hermosa galería dentro de un restaurado palacio francés que es una pieza emblemática de la ciudad. Cuenta con una exhibición de arte y una estructura industrial con excelente iluminación. Sus impecables pisos de maderas, sus sillones de cuero negro, sus alfombras y sus subdivisiones de hierro forjado y vidrio crean un ambiente de intimidad y suntuosidad. Es un buen sitio para realizar todo tipo de encuentro dentro de un marco de elegancia, distinción y calidez. Además, se permiten caterings externos. <br />\n<br />\nZona: Montserrat<br />\n<br />\n- Incluye hora de armado y desarmado.', NULL, NULL, 2, 2, 0, 0, 120, 120, 60, 'Moreno 502', 'CABA', 'Buenos Aires', 'Argentina', '-58.3734206', '-34.6113893', 0.00, NULL, 'flexible', NULL, 6, 17, 0, '2017-05-06 01:42:04', '2017-07-21 20:38:53', NULL, 1),
(23, 3, 'Moderna casa con jardín mágico', 'Casa moderna ubicada a metros de la General Paz, despliega su alcance artístico a través de su estética y majestuosa dimensión. Su living invita a reconfortarse y acomodarse mientras se observan las fotografías de autor a su alrededor. Toda la instalación está pensada desde la mayor calidad estética. El jardín mágico en su área posterior, sorprende a los invitados y a todos aquellos que aspiran por la naturaleza. Ideal para organizar tus eventos.<br />\n<br />\nZona: Vicente López', NULL, NULL, 4, 2, 0, 0, 280, 180, 100, 'Gaspar Campos 1711', 'Buenos Aires', 'Vicente López', 'Argentina', '-58.480945', '-34.5199306', 0.00, NULL, 'moderado', NULL, 6, 4, 0, '2017-05-09 02:35:19', '2017-10-09 19:35:47', NULL, 1),
(24, 8, 'Galpon tipo industrial', 'Existen múltiples variantes del texto original, algunas casi sin parecido con él. Estas versiones incluyen letras adicionales que no son comunes en latín (como la k, w y z) o palabras sin sentido como zzril, takimata y gubeergren que intentan hacer la distribución aún más parecida al inglés.<br /><br />\n<br /><br />\nVarios editores de texto proveen la funcionalidad de generación de lorem ipsum.', NULL, NULL, 2, 3, 0, 400, 150, 150, 100, 'Avenida San Martín 7438', 'CABA', 'Buenos Aires', 'Argentina', '-58.5179137', '-34.5898708', 2500.00, NULL, 'moderado', NULL, 2, 31, 0, '2017-05-09 23:02:15', '2017-07-12 23:15:02', NULL, 0),
(25, 9, 'Elegante departamento francés reciclado', 'Este departamento francés reciclado, ubicado en una de las calles más reconocidas de la Ciudad, cuenta con un elegante living, cocina remodelada y sala de música y proyección. Sus paredes son blancas pero los cuadros, objetos y decoraciones elegidos le dan el color necesario para crear una atmósfera vibrante. Es un gran sitio para realizar producciones aprovechando la excelente luz que ingresa de sus balcones franceses.<br />\n<br />\nZona: Recoleta', NULL, NULL, 3, 2, 0, 85, 15, 15, 8, 'Avenida Presidente Manuel Quintana 222', 'CABA', 'Buenos Aires', 'Argentina', '-58.38724209999999', '-34.5906314', 2000.00, 'https://my.matterport.com/show/?m=GgeV5Ao79qL', 'moderado', NULL, 6, 18, 0, '2017-05-10 19:13:04', '2017-07-21 20:21:24', NULL, 1),
(28, 11, 'Galería artística y cultural', 'Este lugar ubicado en el artístico barrio de Palermo está compuesto por dos salas de exhibición, un auditorio, una tienda de diseño y un atractivo patio. Tanto su interior como su exterior ofrecen un ambiente íntimo y relajado. Sus paredes blancas y su decoración minimalista son el marco perfecto para llevar a cabo lanzamientos, workshops, conferencias donde los asistentes sean los protagonistas. Además, cuenta con servicio de seguridad y pueden utilizarse caterings externos.<br />\nUn lugar de encuentro para todo medio de expresión.<br />\n<br />\nZona: Palermo', NULL, NULL, 4, 2, 0, 0, 150, 150, 70, '5041 Nicaragua', 'CABA', 'Buenos Aires', 'Argentina', '-58.42888379999999', '-34.585013', 0.00, 'https://my.matterport.com/show/?m=6UZdhUZH7KX', 'moderado', NULL, 6, 3, 0, '2017-05-16 18:11:04', '2017-07-21 20:22:19', NULL, 1),
(30, 12, 'Versátil y minimalista espacio palermitano', 'Un largo pasillo en el corazón de Palermo esconde a este espacio que se caracteriza por su estilo minimalista. Sólo decoran las paredes algunos estantes de madera y hierro y un gran ventanal hacia el fondo de la propiedad que permite el paso de la cálida luz. La simpleza se vuelve un arma poderosa que da pie a la versatilidad y creatividad. Por estos motivos, a la hora de organizar cualquier tipo de evento esta propiedad se vuelve una gran opción. <br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.', NULL, NULL, 2, 1, 0, 0, 40, 40, 18, 'Gorriti 4743', 'CABA', 'Buenos Aires', 'Argentina', '-58.4284088', '-34.5910222', 0.00, NULL, 'moderado', NULL, 6, 5, 0, '2017-05-19 19:09:55', '2017-07-21 20:35:42', NULL, 1),
(32, 15, 'Galpón social y performático', 'Espacio de experimentación, desarrollo e innovación. Todas sus salas permiten múltiples usos y transformaciones para ser adaptadas a piacere.<br />\n<br />\nZona: Palermo<br />\n<br />\nLa Hora Extra se cuenta a partir de los 15 minutos excedidos<br />\n- Incluye hora de armado y desarmado.<br />\n<br />\nAccesorios:<br />\nUtilización de proyector $400.- ARS<br />\nTécnico de Sonido $300.- ARS<br />\nTécnico de Luces $300.- ARS<br />\n', NULL, NULL, 6, 2, 0, 2, 90, 90, 60, '1473 Arévalo', 'CABA', 'Buenos Aires', 'Argentina', '-58.44258689999999', '-34.5829618', 500.00, NULL, 'flexible', NULL, 6, 6, 0, '2017-05-19 22:28:18', '2017-09-01 19:29:48', NULL, 1),
(33, 13, 'Salón de la Belle Époque reciclado', 'Emplazada en el tradicional barrio de Colegiales, se encuentra este antiguo salón de fiestas que fue faro cultural y social de la ciudad desde 1942, una construcción de Carlos Agote –arquitecto célebre de la historia argentina- reciclado en estudio de fotografía, arte, publicidad y moda, con terraza patio andaluz original de 1940. Ideal para todo tipo de encuentros. Esta increíble propiedad sorprende a quienes la visitan por sus amplios espacios que pueden albergar hasta a 300 personas aprox. El conservado piso de roble de Slavonia con el que cuenta la residencia, transforma al espacio en uno mucho más acogedor e íntimo. Paredes blancas, escaleras de mármol y espejos especialmente ubicados completan el magnífico escenario.<br />\n<br />\nZona: Colegiales<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n', NULL, NULL, 0, 3, 0, 600, 300, 300, 150, 'Lacroze 2963 Avenida Federico', 'CABA', 'Buenos Aires', 'Argentina', '-58.448116', '-34.575441', 0.00, NULL, 'moderado', NULL, 6, 15, 0, '2017-05-20 01:28:53', '2017-07-21 20:23:27', NULL, 1),
(37, 13, 'Rooftop Colonial', 'Apreciar el impactante cielo de Buenos Aires es mucho más fácil en los barrios de casas bajas como Colegiales y en esta espaciosa terraza colonial la experiencia es todavía más sublime. Esta increíble propiedad construida en 1942 por Carlos Agote (uno de los arquitectos más célebres de la historia argentina del período 1890-1942) sorprende a quienes la visitan por sus amplio espacio que pueden albergar hasta a 200 personas, entre los cuales destaca su azotea, un patio andaluz original que ha albergado producciones fotográficas para algunos de las revistas de moda más importantes del mundo como Vogue o GQ. La vista de la misma y la decoración de los azulejos coloniales la vuelven una opción perfecta para organizar cualquier tipo de cocktail o proyección.<br />\n<br />\nZona: Colegiales<br />\n<br />\n- Incluye hora de armado y desarmado.', NULL, NULL, 0, 3, 0, 300, 200, 200, 80, 'Lacroze 2963 Avenida Federico', 'CABA', 'Buenos Aires', 'Argentina', '-58.448116', '-34.575441', 0.00, NULL, 'moderado', NULL, 6, 24, 0, '2017-05-24 19:51:15', '2017-07-21 20:23:45', NULL, 1),
(38, 14, 'Impecable estudio en el distrito del arte', 'Este hermoso estudio se encuentra en el barrio de Palermo y cuenta con iluminación Led, sector de make up y un set fotográfico de 9X5 metros. Se caracteriza por sus paredes blancas y la elección de muebles, objetos y lámparas que le brindan un estilo nórdico. Es un buen lugar para realizar conferencias, lanzamientos y reuniones en un ambiente minimalista y relajado. Además, tiene una muy buena ubicación y se pueden usar caterings externos.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye una hora de armado y desarmado del espacio.<br />\n- Sábados y feriados se incrementa un 15% el precio.<br />\n- En producción: El precio incluye 1 metro de fondo pisado y los equipos de iluminación.', NULL, NULL, 2, 1, 0, 0, 40, 40, 18, '4743 Gorriti', 'CABA', 'Buenos Aires', 'Argentina', '-58.4284088', '-34.5910222', 0.00, 'https://my.matterport.com/show/?m=7wYLdkvjM19', 'estricto', NULL, 6, 21, 0, '2017-05-25 16:50:36', '2017-07-21 20:36:30', NULL, 1),
(41, 10, 'Ventanales y bibliotecas que brindan calidez', 'Ubicado en el barrio de Palermo Hollywood, este multiespacio ofrece bar, vinería y hasta un restaurant con gastronomía de autor de alto nivel, vinos especialmente seleccionados, pastelería y panadería casera. Entre otras cosas, los detalles que caracterizan a este espacio son los amplios ventanales, las bibliotecas repletas de libros y las pequeñas luces que iluminan los ambientes. Es un lugar para el disfrute de todos los sentidos, esto junto con su gran equipamiento lo transforman en una perfecta opción para organizar todo tipo de encuentro.<br />\n<br />\nCapacidad máxima: 100 invitados<br />\n<br />\nDisponibilidad:<br />\n<br />\nLunes.........................09:00hs - 02:00hs<br />\nMartes ......................09:00hs - 02:00hs<br />\nMiércoles………………...09:00hs - 02:00hs<br />\nJueves ......................09:00hs - 02:00hs<br />\nViernes .....................09:00hs - 02:00hs<br />\nSábado .....................09:00hs - 02:00hs<br />\nDomingo....................09:00hs - 02:00hs<br />\n<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.', NULL, NULL, 2, 2, 0, 0, 100, 100, 50, 'Humboldt 1981', 'CABA', 'Buenos Aires', 'Argentina', '-58.4327643', '-34.5826848', 0.00, NULL, 'moderado', NULL, 6, 23, 0, '2017-05-25 23:31:57', '2017-05-26 01:35:07', NULL, 1),
(42, 10, 'Multifacética galería de arte', 'Esta galería de arte se encuentra ubicada en el barrio de Palermo. No sólo funciona como galería sino que además se trata de una plataforma para el desarrollo de todo tipo de proyectos relacionados con la cultura. Ofrecen, además, cocina de autor y se especializan en la enología. Teniendo en cuenta estas características, este espacio es sumamente acogedor y perfecto para realizar cualquier tipo de encuentros. Además, cuenta con acceso para discapacitados.<br />\n<br />\nCapacidad máxima: 45 invitados<br />\n<br />\nDisponibilidad:<br />\n<br />\nLunes.........................09:00hs - 22:00hs<br />\nMartes ......................09:00hs - 22:00hs<br />\nMiércoles………………...09:00hs - 22:00hs<br />\nJueves ......................09:00hs - 22:00hs<br />\nViernes .....................09:00hs - 22:00hs<br />\nSábado .....................09:00hs - 22:00hs<br />\nDomingo....................09:00hs - 22:00hs<br />\n<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.', NULL, NULL, 2, 2, 0, 0, 45, 45, 22, 'Humboldt 1981', 'CABA', 'Buenos Aires', 'Argentina', '-58.4327643', '-34.5826848', 0.00, NULL, 'moderado', NULL, 6, 29, 0, '2017-05-26 01:41:55', '2017-05-26 02:07:50', NULL, 1),
(44, 16, 'Rooftop único en el casco histórico porteño', 'Salón privado, ideal para todo tipo de eventos. Moderno, ubicado en el casco histórico porteño, combina diseño, tecnología y estilo de autor.  <br />\nPragmático, ideal tanto para bodas y festejos varios, como para cenas a puertas cerradas, jornadas laborales, cocktails, muestras de arte.<br />\nCreado para vivirlo con intensidad, la sala comprende el salón principal con salón de bar, dos barras, una interna y otra externa, una amplia terraza con pileta y vista a la cúpula de San Francisco de Asís, baños individuales, un sector de recepción, un extenso balcón, y una cocina profesional.<br />\n INSERT INTO `espacios` (`id`, `user_id`, `name`, `description`, `rule`, `politcancel`, `quantyrooms`, `quantybathrooms`, `floor`, `surface`, `quanty`, `foot`, `seated`, `adress`, `city`, `state`, `country`, `long`, `lat`, `securitydeposit`, `image360`, `cancellationflexibility`, `type`, `step`, `order`, `rango_precios`, `created_at`, `updated_at`, `deleted_at`, `status`) VALUES
(78, 52, 'Señorial mansión al borde del Lago Central', 'Esta fantástica mansión es la locación perfecta para llevar a cabo todo tipo de reuniones íntimas en un ambiente distendido a través de sus dimensiones y su maravillosa vista al Lago Central de Nordelta.<br />\n<br />\nZona: Nordelta', NULL, NULL, 5, 2, 0, 0, 15, 15, 8, NULL, 'Buenos Aires', 'Rincón de Milberg', 'Argentina', '-58.65530880000001', '-34.419434', 0.00, NULL, 'moderado', NULL, 6, 9, 0, '2017-06-25 22:04:18', '2017-07-21 19:50:45', NULL, 1),
(79, 53, 'Estudio de Meditación ', 'Espacio sereno en plena Recoleta. Su excelente disposición frente al patio interno invita a relajarse y conciliar el pensamiento.<br />\nIdeal para llevar a cabo cursos de yoga, meditación, estiramiento o coaching.<br />\n<br />\nBarrio: San Isidro<br />\n<br />\nCapacidad máxima: 25 invitados<br />\n<br />\n- Avisar con 10 o más días de anticipación.<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.<br />\n', NULL, NULL, 2, 1, 0, 0, 25, 25, 12, 'Sebastián Elcano 990', 'Buenos Aires', 'San Isidro', 'Argentina', '-58.49021469999999', '-34.4731935', 0.00, NULL, 'moderado', NULL, 4, 31, 0, '2017-06-25 22:46:01', '2017-07-13 03:48:48', NULL, 0),
(80, 54, 'Synergic Workspace', 'Un espacio de co-working que resuelve todos los problemas de instalaciones, para que tu empresa tenga que preocuparse solo por crecer y generar nuevos negocios.<br />\n<br />\nZona: Belgrano<br />\n<br />\nLos valores expresados son en alquiler parcial, existe posibilidad de alquiler privado. ', NULL, NULL, 7, 8, 0, 950, 50, 50, 25, 'Avenida Cabildo 2040', 'CABA', 'Buenos Aires', 'Argentina', '-58.45646249999999', '-34.5627365', 0.00, NULL, 'flexible', NULL, 6, 39, 0, '2017-06-26 20:44:18', '2017-07-21 19:56:48', NULL, 1),
(81, 40, 'Íntimo auditorio cultural', 'Hermoso auditorio para cine, teatro y minirecitales para todo tipo de encuentro artístico y cultural.<br />\n<br />\nZona: Villa Crespo<br />\n<br />\nAdicionales:<br />\nSonido y puesta de luces; proyector; técnicos; servicio de catering; servicio de Barra Libre; shows en vivo de música; danza; stand up; Dj; Vj; y actividades y talleres para adultos y/o niños.<br />\n', NULL, NULL, 1, 2, 0, 60, 90, 90, 50, 'Pringles 1249', 'CABA', 'Buenos Aires', 'Argentina', '-58.426233', '-34.597356', 500.00, NULL, 'estricto', NULL, 6, 48, 0, '2017-06-26 21:41:09', '2017-07-21 20:41:24', NULL, 1),
(82, 227, 'Vasto espacio de inmejorable ubicación', 'Este ambiente se encuentra ubicado dentro de una moderna edificación, caracterizada por su arquitectura de primer nivel. Cuenta con tres barras, área VIP y toda la infraestructura y servicios asociados a las actividades, además de un balcón de libre acceso para los invitados a los eventos.<br />\n<br />\nZona: Recoleta<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.', NULL, NULL, 5, 2, 0, 1000, 500, 500, 250, 'Avenida Pueyrredón 2501', 'CABA', 'Buenos Aires', 'Argentina', '-58.39279899999999', '-34.5862489', 10000.00, NULL, 'estricto', NULL, 6, 50, 0, '2017-06-27 22:15:12', '2017-07-21 20:31:10', NULL, 1),
(83, 54, 'Espacio único y moderno, distinto a todo', 'Este espacio es un lugar diferente, un oasis en el medio de la ciudad. Cocktails, fiestas, cursos, capacitaciones, conferencias y más! <br />\n<br />\nZona: Belgrano<br />\n<br />\nNo está incluido la Seguridad.<br />\nLa capacidad de personas puede llegar a afectar el valor del presupuesto estimado.', NULL, NULL, 2, 6, 0, 0, 300, 300, 120, 'Avenida Cabildo 2040', 'CABA', 'Buenos Aires', 'Argentina', '-58.45646249999999', '-34.5627365', 0.00, NULL, 'flexible', NULL, 6, 68, 0, '2017-06-28 00:09:39', '2017-07-21 19:58:24', NULL, 1),
(84, 55, 'Funcional co-working con ambientes sociales', 'Espacio amplio, con un lindo diseño, bien equipado donde encontrarás livings, salas de reuniones de todos los tamaños, oficinas privadas, un comedor, mesas de trabajo, salón de eventos con cañón y pantalla, una terraza con parrilla y entrada centralizada.<br />\n<br />\nZona: Vicente López', NULL, NULL, 3, 6, 0, 0, 20, 20, 20, 'Gobernador Valentín Vergara 1485', 'Buenos Aires', 'Vicente López', 'Argentina', '-58.48298519999999', '-34.5246683', 1000.00, NULL, 'flexible', NULL, 6, 61, 0, '2017-06-28 00:36:17', '2017-07-21 19:59:59', NULL, 1),
(85, 56, 'Naturaleza pura en una casona antigua', 'En el atractivo barrio de Palermo se encuentra esta hermosa casona antigua totalmente remodelada pero igual de mágica. Cuenta con un gran patio lleno de plantas, árboles y enredaderas creando un ambiente acogedor y de pura naturaleza. Su estilo antiguo, su exterior lleno de verde y su ambiente relajado se unen para crear el lugar perfecto en el cual realizar todo tipo de encuentro. Además, tiene su propio servicio de seguridad y puede alojar hasta 200 personas.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Precio de Lunes a Jueves se reduce un 12%. Los valores SÓLO incluyen el alquiler del salón.', NULL, NULL, 4, 3, 0, 0, 200, 200, 100, 'Costa Rica 4677', 'CABA', 'Buenos Aires', 'Argentina', '-58.42678900000001', '-34.5880912', 3500.00, NULL, 'moderado', NULL, 6, 44, 0, '2017-06-28 01:48:04', '2017-07-21 20:01:48', NULL, 1),
(86, 40, 'Salas coloridas con personalidad', 'Con sus paredes llenas de colores y dibujos, la gran diversidad de espacios y su ambiente distendido, este lugar es una gran opción para realizar muestras, reuniones o clases, con un toque artístico.<br />\n<br />\nZona: Villa Crespo<br />\n<br />\nAdicionales:<br />\nSonido y puesta de luces; proyector; técnicos; servicio de catering; servicio de Barra Libre; shows en vivo de música; danza; stand up; Dj; Vj; y actividades y talleres para adultos y/o niños.', NULL, NULL, 2, 2, 0, 0, 40, 40, 20, 'Pringles 1249', 'CABA', 'Buenos Aires', 'Argentina', '-58.426233', '-34.597356', 0.00, NULL, 'estricto', NULL, 6, 57, 0, '2017-06-28 02:14:26', '2017-07-21 20:41:42', NULL, 1),
(87, 52, 'Vasto espacio verde de ensueño', 'Espacio verde de grandes dimensiones con estructuras de metal que maravillan la vista y generan una sensación de plenitud y envolvencia.<br />\n<br />\nZona: Solís', NULL, NULL, 0, 2, 0, 0, 300, 300, 180, NULL, 'Buenos Aires', 'Solis', 'Argentina', '-59.3214973', '-34.2991908', 0.00, NULL, 'moderado', NULL, 6, 58, 0, '2017-06-28 02:33:39', '2017-07-21 19:52:06', NULL, 1),
(88, 57, 'Elegante d', 'El título de una publicación debe concentrar en una frase el diferencial de tu espacio o lo que te hace sentir. Recuerda no poner nombres comerciales ni direccion', NULL, NULL, 2, 1, 0, 60, 10, 10, 0, 'Galileo 2464', 'CABA', 'Buenos Aires', 'Argentina', '-58.39733620000001', '-34.58539400000001', 1000.00, NULL, 'flexible', NULL, 4, 31, 0, '2017-06-29 21:50:28', '2017-06-29 21:54:46', NULL, 0),
(89, 58, 'Sala industrial reciclada con ladrillo a la vista', 'En Colegiales se encuentra este espacio de co-working diseñado sobre plantas abiertas con sectores al aire libre. Cuenta con paredes de ladrillo a la vista, pisos  originales de la fábrica, techos altos y un mobiliario de madera en tonos claros. El ambiente en cuestión es una planta subsuelo que se ubica en un loft dentro de una fábrica reciclada en un edificio de uso mixto (hay tanto oficinas como residencias). Lo más atractivo de este espacio es justamente eso: el contraste entre las reminiscencias de lo que fue una fábrica y los toques cálidos de la madera. Excelente para todo tipo de encuentro.<br />\n<br />\nZona: Colegiales<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n<br />\nAgregar a la política de cancelación “Moderada” + reembolso 50% entre 10 y 5 días antes del evento, excepto gastos de procesamiento', NULL, NULL, 2, 1, 0, 120, 60, 60, 40, 'Céspedes 3249', 'CABA', 'Buenos Aires', 'Argentina', '-58.45351520000001', '-34.5767195', 4000.00, NULL, 'moderado', NULL, 6, 69, 0, '2017-07-02 02:33:47', '2017-07-21 20:27:10', NULL, 1),
(90, 59, 'CASA ', 'FHGSZFGHSZBVJHFB', NULL, NULL, 1, 1, 0, 40, 20, 20, 0, NULL, NULL, NULL, NULL, NULL, NULL, 2.00, NULL, 'flexible', NULL, 4, 31, 0, '2017-07-05 18:18:00', '2017-07-05 18:23:38', NULL, 0),
(91, 60, 'Distinguido estudio de música', 'Inspirador estudio de música que transporta a quien lo visita a las grandes épocas del rock nacional. Divertido, íntimo y colorido, este espacio puede otorgarle a una producción de fotos o video un toque rockero o desfachatado. Alfombras en el piso, iluminación tenue y revestimientos de madera son algunas de las características que ofrece este ambiente puramente musical. Es un gran escenario para todo tipo de producciones o actividades artísticas.<br />\n<br />\nZona: Constitución', NULL, NULL, 0, 2, 0, 0, 60, 60, 30, 'Solís 1769', 'CABA', 'Buenos Aires', 'Argentina', '-58.3894512', '-34.6286085', 0.00, NULL, 'moderado', NULL, 6, 70, 0, '2017-07-05 21:28:55', '2017-07-21 20:24:24', NULL, 1),
(92, 53, 'Apacible espacio de meditación con vista espectacular', 'Espacio sereno y apacible en la costa ribereña. Su envoltura en colores claros dan sensación de calidez que potencia la relajación.<br />\nIdeal para llevar a cabo cursos de yoga, meditación, estiramiento o coaching.<br />\n<br />\nZona: San Isidro<br />\n<br />\n- Avisar con más de 10 días de anticipación.', NULL, NULL, 3, 2, 0, 0, 25, 25, 12, 'Sebastián Elcano 990', 'Buenos Aires', 'San Isidro', 'Argentina', '-58.49021469999999', '-34.4731935', 0.00, NULL, 'moderado', NULL, 6, 16, 0, '2017-07-06 06:04:31', '2017-07-21 19:54:39', NULL, 1),
(94, 63, 'Distinguida y elegante mansión de estilo francés', 'Esta imponente casona antigua, perfectamente conservada, se encuentra en el distinguido barrio de Barrio Parque - Palermo. Tiene amplios espacios con hermosos pisos de madera, muebles impecables y grandes ventanales, junto a un patio de ensueño. Todo está pensado hasta el último detalle con la meta de mantener un estilo elegante en cada sector. Es un espacio ideal para realizar eventos, producciones y reuniones en un ambiente refinado e íntimo. <br />\n<br />\nZona: Palermo', NULL, NULL, 4, 2, 0, 0, 100, 100, 40, 'Avenida Ortiz de Ocampo 2871', 'CABA', 'Buenos Aires', 'Argentina', '-58.40291089999999', '-34.578997', 0.00, NULL, 'moderado', NULL, 6, 8, 0, '2017-07-11 00:08:39', '2017-07-21 19:53:24', NULL, 1),
(95, 64, 'Antigua fábrica transformada en salón de encanto', 'Una propuesta diferencial en el centro de la ciudad. Para todo tipo de pop-ups y producciones, con paredes de ladrillo a la vista, y vitraux con luz natural, es un lugar único y diferencial, que asegura un toque mágico e inigualable.<br />\n<br />\nZona: San Telmo<br />\n<br />\nComo depósito, se puede entregar un cheque de caución.', NULL, NULL, 7, 4, 0, 500, 250, 250, 120, 'Perú 338', 'CABA', 'Buenos Aires', 'Argentina', '-58.37471240000001', '-34.6118796', 10000.00, 'https://my.matterport.com/show/?m=KwziPaTGurE', 'estricto', NULL, 6, 35, 0, '2017-07-13 02:41:14', '2017-07-21 20:22:53', NULL, 1),
(96, 9, 'Monumental fábrica “abandonada”', 'En el Barrio de Boedo se encuentra este edificio de tres plantas de clásica estampa industrial de comienzos del siglo XX que en su momento de esplendor supo alojar a 800 operarios. Tiene la imponencia de un transatlántico anclado en el olvido.<br />\nIdeal para producciones fotográficas o fílmicas.<br />\n<br />\nZona: Boedo', NULL, NULL, 8, 0, 0, 0, 20, 20, 20, 'La Plata 2046 Avenida', 'CABA', 'Buenos Aires', 'Argentina', '-58.4237576', '-34.6385533', 0.00, NULL, 'moderado', NULL, 6, 60, 0, '2017-07-13 20:56:12', '2017-08-03 19:57:57', NULL, 1),
(97, 66, 'Garage apasionado por el mundo de las dos ruedas', 'Garage con raíces provenientes del mundo de las carreras motorizadas. Ambientado con objetos de autor y estética propia. Cuenta con una cafetería y un bar. <br />\n<br />\nZona: San Isidro<br />\n<br />\nLos días viernes y sábados tiene un +20% sobre el precio estimado, los lunes y martes -20% sobre el precio estimado.', NULL, NULL, 0, 2, 0, 500, 150, 150, 60, 'Primera Junta 1118', 'Buenos Aires', 'San Isidro', 'Argentina', '-58.5072218', '-34.4610356', 1000.00, 'https://my.matterport.com/show/?m=sFBCCqCr59X', 'moderado', NULL, 6, 40, 0, '2017-07-14 00:26:33', '2017-07-21 20:03:44', NULL, 1),
(98, 68, 'Espacio de oficinas creativas', 'El título de una publicación debe concentrar en una frase el diferencial de tu espacio o lo que te hace sentir. Recuerda no poner nombres comerciales ni direcciones. En el campo de descripción, explaya tu espacio a grandes rasgos para que los organizadores puedan hacerse una idea general antes de entrar en detalles contigo. También puedes utilizar la descripción para resaltar las cualidades que tiene el mismo en las diversas actividades en que lo inscribas.<br />\n<br />\nBarrio: Las Condes', NULL, NULL, 4, 4, 0, 350, 20, 20, 10, 'Sebastián 2957 San', 'Región Metropolitana', 'Las Condes', 'Chile', '-70.5998429', '-33.4133295', 5000.00, NULL, 'moderado', NULL, 4, 59, 0, '2017-07-14 02:06:21', '2017-07-14 02:22:29', NULL, 0),
