(100, 21, 'Moderno y cálido restaurant de autor ', 'Una propuesta de comfort, a la que en se agrega una barra ideal para compartir con amigos a la hora del café o del happy hour.<br />\nLas intervenciones artísticas, la calidez minimalista y sus plato de autor reflejan un viaje de sentidos.<br />\nSu reconocida pastelería casera, y sus panes artesanales, hechos con recetas originales, ahondan en la experiencia. A la hora del almuerzo y la cena, se proporciona una propuesta moderna de platos, donde los productos son los protagonistas.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Lunes y Martes: un 20% menor el precio del espacio.<br />\n-Viernes y Sábado: un 20% mayor el precio del espacio.<br />\n<br />\nLos valores expresados son en alquiler privado, existe posibilidad de alquiler parcial. ', NULL, NULL, 3, 3, 0, 150, 200, 200, 120, 'Gorriti 5641', 'CABA', 'Buenos Aires', 'Argentina', '-58.437502', '-34.5845629', 0.00, NULL, 'estricto', NULL, 6, 49, 0, '2017-07-14 22:13:29', '2017-07-21 20:32:30', NULL, 1),
(101, 21, 'Sala moderna de estilo escandinavo', 'Una propuesta de comfort, a la que en se agrega una barra ideal para compartir con amigos a la hora del café o del happy hour. Su estilo minimalista y estética artística propone un ambiente de calidez y bienestar.<br />\nSu reconocida pastelería casera, y sus panes artesanales, hechos con recetas originales generan una aventura de sensaciones.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Lunes y Martes: un 20% menor el precio del espacio.<br />\n-Viernes y Sábado: un 20% mayor el precio del espacio.<br />\n<br />\nLos valores expresados son en alquiler parcial, existe posibilidad de alquiler privado.', NULL, NULL, 3, 3, 0, 90, 70, 70, 60, 'Gorriti 5641', 'CABA', 'Buenos Aires', 'Argentina', '-58.437502', '-34.5845629', 0.00, NULL, 'estricto', NULL, 6, 32, 0, '2017-07-14 23:23:20', '2017-07-21 20:32:53', NULL, 1),
(102, 21, 'Maravilloso jardín escondido con sala de arte', 'Salón de Arte exquisito con un jardín mágico de ensueño. Sus pinturas artísticas y calidez espacial permiten que cualquier tipo de evento se pueda realizar en el espacio. <br />\nSu jardín brinda un pulmón de creatividad, en plena urbe para desconectarse de la rutina.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Lunes y Martes: un 20% menor el precio del espacio.<br />\n-Viernes y Sábado: un 20% mayor el precio del espacio.', NULL, NULL, 3, 3, 0, 150, 100, 100, 50, 'Gorriti 5641', 'CABA', 'Buenos Aires', 'Argentina', '-58.437502', '-34.5845629', 0.00, NULL, 'estricto', NULL, 6, 12, 0, '2017-07-15 03:27:35', '2017-08-15 18:54:22', NULL, 1),
(104, 69, 'Vibrante Pub Británico junto al río', 'Con una excelente vista al Río de la Plata -el más ancho del mundo- y una cálida ambientación típica de los pubs británicos, este espacio ofrece una experiencia única en sensaciones y sabores para acompañar todo tipo de estado de ánimo y compañía. Su clima portuario, excelente servicio gastronómico y detalles encantadores hacen de la experiencia un cruce marítimo del Atlántico sin ni siquiera tener que cruzarlo.<br />\n<br />\nZona: Palermo<br />\n<br />\nDJ, servicio de catering, sonido, iluminación, ambientación, entre otros; se cotizan de acuerdo a los requerimientos del cliente.', NULL, NULL, 4, 4, 0, 700, 400, 400, 250, NULL, 'CABA', 'Buenos Aires', 'Argentina', '-58.40888829999999', '-34.5595636', 2500.00, NULL, 'moderado', NULL, 6, 11, 0, '2017-07-15 04:17:10', '2017-08-08 04:17:31', NULL, 1),
(105, 72, 'Ex-fábrica devenida en espacio artístico hipster y under ', 'Espacio multiuso donde trabajan cotidianamente artistas plásticos, ensayan bandas de rock, obras de teatro y danza y se dictan talleres varios. Realizamos eventos, producciones y encuentros de todo tipo: desde muestras de arte, festivales de teatro, danza y música, hasta eventos de marca, ferias, producciones de fotos, filmaciones o eventos puntuales que nos proponen dadas las características muy diversas y particulares del espacio. <br />\nCombinamos un ambiente industrial que recuerda a la vieja fábrica textil que funcionó en el espacio hasta los 90s, con una estética under, hipster, retro y urbana, capaz de adaptarse y transformarse para cada ocasión.<br />\n<br />\nZona: San Telmo<br />\n<br />\nEl máximo de invitados en reuniones es de 30 personas.<br />\nTanto la limpieza inicial y final como la seguridad corre por cuenta del espacio.', NULL, NULL, 6, 2, 0, 250, 120, 120, 40, '442 Perú', 'CABA', 'Buenos Aires', 'Argentina', '-58.37445129999999', '-34.6129728', 3000.00, NULL, 'moderado', NULL, 6, 71, 0, '2017-07-18 21:12:31', '2017-07-21 20:10:35', NULL, 1),
(106, 73, 'Casona reciclada en oficinas creativas', 'Somos un espacio de oficinas también disponible para eventos y reuniones ubicado en Palermo Soho.<br />\n<br />\nZona: Palermo', NULL, NULL, 3, 3, 0, 0, 120, 120, 30, '4999 Costa Rica', 'CABA', 'Buenos Aires', 'Argentina', '-58.4298678', '-34.5861404', 0.00, NULL, 'moderado', NULL, 6, 27, 0, '2017-07-18 22:07:46', '2017-07-21 20:12:33', NULL, 1),
(107, 74, 'Food Truck, en pleno Recoleta!', 'Nuestro espacio es único! Un Food Truck dentro de un local, no se ve todos los días! Está ambientado como si fuera una calle, con pisos de adoquines, carteles de calle, semáforo.<br />\nContamos con una barra de 8 canillas de cerveza artesanal, un patio interno y un escenario! Estamos en el corazón de Recoleta! Un Food Truck, en un Store! Vení a disfrutar de nuestro espacio! Ideal para cualquier tipo de evento.<br />\n<br />\nZona: Recoleta<br />\n<br />\n*No cuenta con Seguridad, la tarifa de día completo es a partir de las 8 hs.<br />\n*Los valores expresados son en alquiler privado, existe posibilidad de alquiler parcial. <br />\n', NULL, NULL, 2, 3, 0, 140, 150, 150, 96, 'Avenida Callao 2092', 'CABA', 'Buenos Aires', 'Argentina', '-58.3864166', '-34.5868217', 1000.00, NULL, 'moderado', NULL, 6, 53, 0, '2017-07-18 23:05:05', '2017-07-21 20:16:23', NULL, 1),
(108, 75, 'Lindísimo departamento estilo francés, en pleno Recoleta', 'Departamento estilo Francés, con grandes ambientes luminosos de techos altos y pisos de pinotea, íntegramente reciclados, respetando su estilo antiguo. Los espacios se encuentran exquisitamente amueblados, con detalles de diseño. También existe la opción de vaciar la mayoría de los espacios. La cocina bonita  con horno industrial, se encuentra disponible para eventos y reuniones.  <br />\n<br />\nZona: Recoleta', NULL, NULL, 4, 3, 0, 180, 50, 50, 30, 'Rodríguez Peña 1131', 'CABA', 'Buenos Aires', 'Argentina', '-58.3920398', '-34.5955769', 5000.00, 'https://my.matterport.com/show/?m=Q9LY5ZLsmL1', 'moderado', NULL, 6, 10, 0, '2017-07-19 00:09:25', '2017-07-21 20:17:50', NULL, 1),
(109, 50, 'Antiguo Haras que evoca tranquilidad y bienestar', 'En Arrecifes, Provincia de Buenos aires, a solo 160 km de Capital Federal, un antiguo haras completamente reciclado le propone combinar la tranquilidad de un retiro campestre con actividades rurales y recreativas.<br />\n Todas las comodidades enmarcadas por el típico paisaje de lomas de la zona de Arrecifes le brindas el ambiente necesario para que su estadía sea un cambio al ritmo de vida actual.<br />\n<br />\nZona: Arrecifes<br />\n<br />\nDías de semana un 15% menor el precio de alquiler.<br />\n', NULL, NULL, 9, 7, 0, 6000, 100, 100, 30, NULL, 'Buenos Aires', 'Arrecifes', 'Argentina', '-60.1024864', '-34.0591955', 2000.00, NULL, 'estricto', NULL, 6, 41, 0, '2017-07-19 00:46:46', '2017-07-21 20:35:04', NULL, 1),
(111, 76, 'Amplio salón multidisciplinario', 'Este edificio histórico de tres plantas y un subsuelo, ubicado en pleno San Telmo, cuenta con dos salones en la planta baja, con todas las comodidades y con equipo de sonido, y con un moderno auditorio totalmente equipado. Además, tiene proyectores, pizarras y una barra para coffee break. El lugar ofrece mucha versatilidad a la hora de unir y separar espacios, el espacio puede ser ampliamente transformado, esta ventaja y el buen equipamiento generan una buena oportunidad para realizar muestras de arte y pop-ups. Además, el sitio es de fácil acceso al estar cerca de muchas líneas de subte e importantes avenidas.<br />\n<br />\nZona: San Telmo<br />\n<br />\n*Los fines de semanas hay un 15% de aumento al precio del espacio.', NULL, NULL, 1, 1, 0, 0, 100, 100, 100, 'Moreno 431', 'CABA', 'Buenos Aires', 'Argentina', '-58.3724801', '-34.6113254', 0.00, NULL, 'flexible', NULL, 6, 43, 0, '2017-07-19 01:17:13', '2017-07-21 20:19:40', NULL, 1),
