(115, 78, 'Elegante estancia de madera con jardín de ensueño ', 'Este formidable espacio, está decorado con muy buen gusto bajo una mezcla inmejorable entre lo rústico y lo elegante. Por si fuera poco, a esto se suma un hermoso jardín, ideal para hacer eventos en cualquier momento del día. El lugar propone la unión de dos conceptos: un servicio gastronómico actual junto a una ambientación integrada del espacio y el menú. <br />\n<br />\nDebido a su maleabilidad, es posible ambientar el lugar para cualquier tipo de evento. Es una opción apropiada para realizar reuniones, conferencias, workshops, desayunos o cenas pop-ups, ofreciendo un valor agregado con momentos de esparcimiento en sus fantásticas áreas verdes. <br />\n<br />\nZona: San Isidro', NULL, NULL, 4, 2, 0, 0, 120, 120, 60, 'Roque Sáenz Peña 1159', 'Buenos Aires', 'San Isidro', 'Argentina', '-58.5002771', '-34.4678098', 3000.00, NULL, 'estricto', NULL, 6, 56, 0, '2017-07-25 03:35:50', '2017-07-25 04:01:35', NULL, 1),
