(124, 124, 'Munay ', 'Munay coworking es un espacio de encuentro colaborativo para organizaciones y emprendedores sociales con impacto positivo en su comunidad.<br />\nCompartimos el espacio de trabajo para potenciar nuestras ideas y fortalecer las redes de trabajo. <br />\nCompartimos la visión de crear un mundo mejor a través del trabajo en equipo, la colaboración, el compromiso y el amor.<br />\nLlevamos la innovación como bandera y nos guiamos a través del espíritu creativo.<br />\n<br />\nZona: Colegiales', NULL, NULL, 4, 2, 0, 280, 120, 120, 60, 'Teodoro García 2964', 'CABA', 'Buenos Aires', 'Argentina', '-58.449272', '-34.5750011', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-08-01 23:11:43', '2017-09-25 00:03:36', NULL, 0),
(128, 156, 'Espaciosa galería en el corazón de Palermo Viejo', 'Galería de muebles autóctonos, con mucha luz natural (entra a través de una claraboya, así que se puede tapar fácilmente),  techos altos y vigas para colgar todo tipo de artefactos.  Los 105 metros cuadrados incluyen un patio muy verde con vidriera a la calle. <br />\n<br />\nZona: Palermo', NULL, NULL, 2, 2, 0, 0, 40, 0, 0, '4656 El Salvador', 'CABA', 'Buenos Aires', 'Argentina', '-58.426706', '-34.589779', 10000.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-08-08 23:44:19', '2017-09-25 00:02:35', NULL, 0),
