(130, 17, 'Un espacio exclusivo en la Catedral del Polo', 'El sky box de la cerveza perfecta es tradicionalmente el más concurrido año tras año, y la final del 121º Campeonato Argentino Abierto de Polo en Palermo no fue la excepción. Con DJ en vivo, catering de Fernando Trocca y una ubicación de lujo en el exclusivo palco VIP, variados personajes de distintos ámbitos disfrutaron de la mejor cerveza tirada servida en las tradicionales copas cáliz, que este año contaron con un diseño exclusivo que incluyó el logo del torneo y el hashtag #StellaArtoisPolo.', NULL, NULL, 2, 2, 0, 80, 100, 100, 50, 'Malabia 1500', 'CABA', 'Buenos Aires', 'Argentina', '-58.4282427', '-34.5914339', 0.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-08-10 16:54:56', '2017-09-18 16:24:29', NULL, 0),
