(132, 202, 'Imponente Palacio Francés en Recoleta tipo Petit Hotel', 'Se trata de un espacio multipropósito. Es un Edificio correspondiente a la tipología residencial ¨petit hotel¨, de gran adhesión a principios del Siglo XX. Se trata de una versión minimizada del ¨Grand hotel¨, tipología muy difundida en la aristocracia francesa.<br />\nLa misma organiza el programa en estratos, acomodando los servicios en la planta inferior, dejando el primer piso como ¨piano nobile¨, y el resto de los niveles como dormitorios y salas privadas de los propietarios. Posee un hermoso jardin interno.<br />\nUna gran variedad de vitraux iluminan con luces de distintos tonos que acarician al invitado. Chimeneas y columnas de mármol, terminaciones de madera tallada artesanalmente y la delicada herrería son piezas únicas que acompañan el estilo del Palacio.<br />\nLa elegancia de su arquitectura y la sofisticación de cada uno de sus espacios presentan un escenario muy cómodo para la creación de nuevos eventos, vivencias inolvidables.<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n-Consultar precios en temporada alta.<br />\n<br />\nZona: Recoleta<br />\n<br />\nLos valores expresados son en alquiler privado, existe posibilidad de alquiler parcial.<br />\n<br />\n<br />\n', NULL, NULL, 10, 6, 0, 1500, 350, 350, 150, 'Alvear 1560 Marcelo T. de', 'CABA', 'Buenos Aires', 'Argentina', '-58.3891561', '-34.5972465', 10000.00, NULL, 'moderado', NULL, 6, 74, 0, '2017-08-16 23:07:52', '2017-08-23 01:23:56', NULL, 1),
