(138, 221, 'Experiencias en Yacht premium', 'Embarcación disponible para tu evento. Experiencias navegando por las islas del Delta. Partimos desde San Fernando (opcional Puerto Madero) para navegar por los ríos y canales del Delta. Realizamos paseos, reuniones, cocktails, entre otros. Totalmente equipada. Incluye Capitán y tripulación. <br />\n<br />\nAdicionales: Servicio de Catering, Barra de Tragos, Ski & Wakeboard, Spa On board.<br />\n<br />\nZona: San Fernando<br />\n<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.', NULL, NULL, 3, 3, 0, 80, 50, 60, 25, NULL, 'Buenos Aires', 'San Fernando', 'Argentina', '-58.55796429999999', '-34.4430618', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-08-31 19:36:16', '2017-09-25 05:19:48', NULL, 0),
(139, 225, 'Marinas y Dique del prestigioso Club Náutico', 'Ubicado en el Dique IV de Puerto Madero, el barrio más moderno y seguro de CABA, se encuentra el club privado más prestigioso de la ciudad; ofrece servicios para eventos, como así también, de náutica.  <br />\n<br />\nEn su House flotante de 2.500 m2, se disponen el Salón Principal, la Terraza  y el Deck, que suman 1200 m2.  Su área de gastronomía está a cargo del reconocido Chef Diego Gera.<br />\n<br />\nZona: Puerto Madero', NULL, NULL, 8, 20, 0, 2500, 550, 1100, 550, NULL, 'CABA', 'Buenos Aires', 'Argentina', '-58.3648602', '-34.6020231', 25000.00, NULL, 'flexible', NULL, 6, 1, 0, '2017-09-07 16:53:11', '2017-09-25 05:32:51', NULL, 1),
