(142, 234, 'Casona Facon + Salu club de mesa y cocina', 'En esta casona centenaria (1916) conviven dos proyectos dedicados a celebrar y promover la identidad argentina.<br />\nFACÓN<br />\nTienda de artesanías y diseño argentino<br />\n+<br />\nVinoteca: para degustar un buen vino y una tabla de quesos.<br />\n<br />\nSALÚ<br />\n<br />\nEl primer Club de mesa y cocina del país.<br />\nUn espacio dedicado a los sabores y tradiciones culinarias de la cocina argentina y los rituales en torno a su mesa.<br />\nCLASES – TALLERES – DEGUSTACIONES – CENAS - CATAS<br />\n', NULL, NULL, 3, 2, 0, 100, 100, 100, 50, 'Nicaragua 4880', 'CABA', 'Buenos Aires', 'Argentina', '-58.42785620000001', '-34.5861864', 1000.00, 'https://my.matterport.com/show/?m=nHrYG2gA9fo', 'flexible', NULL, 4, 1, 0, '2017-09-12 20:40:41', '2017-09-21 17:29:35', NULL, 0),
(143, 235, 'Casa colonial en barrio Bellavista', 'Este espacio se encuentra en una casa colonial restaurada con impresionantes techos altos y pisos de mosaico. La casa ha sido remodelada para operar como un cowork. Tiene un solo piso extenso con varias áreas de trabajo. En la primera zona está la recepción, cafetería y un espacio de trabajo modular que también se utiliza para eventos. La segunda zona tiene salas de reuniones, cabinas telefónicas, escritorios y un patio al aire libre. La tercera zona es para oficinas privadas.<br />\n<br />\nZona: Bellavista', NULL, NULL, 3, 3, 0, 200, 100, 100, 50, '67 Constitución', 'Región Metropolitana', 'Providencia', 'Chile', '-70.63455619999999', '-33.4336646', 0.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-09-13 21:02:04', '2017-09-25 06:10:07', NULL, 0),
(144, 236, 'Cafetería con galería de arte', 'Arte + Pop-up Store + Café. Qué más se le puede pedir a un espacio?<br />\nEste espacio cultural concilia un ambiente de encuentro con una actitud relajada que inspira a todos aquellos que ingresan. Sus mesas de ping pong que se convierten en impecables mesas de comedor, la indumentaria colgada de sus paredes o sus pósters hechos a mano; brindan una sensación de hogar y calidez fuera de tu casa.<br />\n<br />\nZona: Palermo', NULL, NULL, 3, 3, 0, 3, 200, 200, 50, 'Gorriti 5045', 'CABA', 'Buenos Aires', 'Argentina', '-58.4315902', '-34.5890148', 4000.00, NULL, 'flexible', NULL, 6, 1, 0, '2017-09-14 04:47:35', '2017-09-28 21:49:01', NULL, 1),
