(150, 249, 'Complejo La Rocchetta', 'Cada evento es único e irrepetible. Nosotros nos ocupamos de que sean inolvidables.<br />\n <br />\nTe ofrecemos distintas opciones para realizar eventos y fiestas en un ambiente único.<br />\n <br />\n➸ Fiestas privadas // Casamientos // Cumpleaños // Fiestas de 15 // Eventos corporativos <br />\n​ <br />\nEl Complejo cuenta con 9 hectares de campo, 2 salones para eventos y un hotel en el mismo predio.<br />\n <br />\nContamos con 2 variedades de menus: criollo y gourmet.', NULL, NULL, 5, 4, 0, 300, 100, 0, 0, NULL, 'Buenos Aires Province', 'Sierra de los Padres', 'Argentina', '-57.7778205', '-37.9474256', 9000.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-09-14 16:17:06', '2017-09-14 16:23:08', NULL, 0),
