(154, 257, 'Casona con patio secreto en Palermo', 'Casa estilo tudor en pleno Palermo, con un patio y un salon con bar, unicos en su estilo. Iluminacion y muebles de epoca. Deck con sillas y mesas, bajo un centenario y majestuoso arbol.<br />\nGradas de madera y livings de exteriores. 2 barras, una con 12 picos de cerveza. Baños para 15 personas. Actualmente funciona como un hostel y beer garden. Abierto a eventos privados.', NULL, NULL, 2, 3, 0, 2, 80, 40, 40, NULL, NULL, NULL, NULL, NULL, NULL, 1000.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-09-14 22:30:19', '2017-09-14 22:48:05', NULL, 0),
