(156, 263, 'LOFT, Salón de usos múltiples ', 'Utilizando como base una casona antigua tradicional argentina , LOFT es un salón amplio de ladrillo a la vista y techo de bobedilla y vigas de madera, manteniendo parte de la arquitectura original De la la antigua casa. <br />\nCon ambientes amplios, baños de hombre y mujer , Cocina industrial y sistema de sonido y luces , loft también cuenta con una cancha de fútbol 3. Es un lugar sumamente versátil para todo tipo de reuniones , seminarios , cursos, clases  o fiestas.', NULL, NULL, 5, 2, 0, 250, 100, 300, 100, 'Chiclana 119', 'Buenos Aires', 'Bernal', 'Argentina', '-58.27022290000001', '-34.7117794', 500.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-09-15 16:28:54', '2017-09-15 16:52:41', NULL, 0),
