(170, 281, 'Mansión Palermo Soho', 'Esta hermosa Mansión de 9 habitaciones se encuentra en el corazón de Palermo Soho. Tiene amplios espacios abiertos con un colorido jardín rodeado de verde, muebles de interior y de patio, parrilla y grandes ventanales que dan luz natural. Es un espacio ideal para realizar eventos, reuniones o producciones en un ambiente cálido, privado y confortable.', NULL, NULL, 2, 2, 0, 80, 55, 55, 55, 'Malabia 1568', 'CABA', 'Buenos Aires', 'Argentina', '-58.4275117', '-34.5909527', 500.00, NULL, 'moderado', NULL, 6, 1, 0, '2017-09-19 16:58:41', '2017-09-29 21:32:50', NULL, 1),
