(173, 235, 'Espacio colaborativo en el restaurado Elefante Blanco', 'Por más de 40 años este edificio fue conocido como el “Elefante Blanco”; el ex Hospital Ochagavía, abandonado durante la dictadura militar.  En 2016, la empresa Megacentro retomó el proyecto y lo renovó completamente transformándolo en un centro de logística y de negocios. Ubicado en el séptimo piso, este espacio ofrece visitas panorámicas, espacio abierto para eventos, salas de conferencias, lounge de reuniones, cabinas privadas para hablar por teléfono, espacio de cafetería y networking y más.<br />\n<br />\nZona: Pedro Aguirre Cerda', NULL, NULL, 3, 2, 0, 400, 100, 100, 60, 'Club Hípico de Santiago 4676', 'Región Metropolitana', 'Pedro Aguirre Cerda', 'Chile', '-70.6675961', '-33.4920604', 0.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-09-20 15:47:23', '2017-09-25 06:11:42', NULL, 0),
(174, 287, 'Fundacion 937sudestada', 'FUNDACIÓN 9,37 SUDESTADA es una plataforma de aproximadamente 615 m2 cubiertos y semicubiertos, con una infraestructura que abarca salas de exposición polivalentes, un área de coffe bar y un shop de productos de diseño. La edificación posee una impronta estética muy contemporánea y limpia. Como materiales protagonistas, conviven en perfecta armonía la madera, el hierro, y las transparencias.<br />\nEspacio moderno y armónico a metros del río reconquista y  tigre centro.<br />\nZona: Tigre ', NULL, NULL, 5, 3, 0, 250, 260, 250, 190, NULL, NULL, NULL, NULL, NULL, NULL, 1000.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-09-20 17:11:12', '2017-09-20 18:03:52', NULL, 0),
