(177, 281, 'Exclusiva Terraza con Deck en Palermo Soho', 'Ubicado en la Terraza de un Petit Hotel en la mejor zona de Palermo Soho, se encuentra este moderno deck con hidromasaje y poltronas, parrilla y muebles de patio, perfecto para cocktails y reuniones distendidas. Cuenta con un espacio cerrado con ventanales y mesas de trabajo, con wifi de alta velocidad incluido, ideal para jornadas de capacitación o reuniones de trabajo en un espacio privado y con luz natural.<br />\n<br />\nZona: Palermo', NULL, NULL, 2, 1, 0, 60, 50, 50, 50, 'Honduras 4742', 'CABA', 'Buenos Aires', 'Argentina', '-58.42764090000001', '-34.5904993', 500.00, NULL, 'moderado', NULL, 6, 1, 0, '2017-09-20 18:19:05', '2017-10-04 01:18:00', NULL, 1),
