(179, 301, 'Casa de campo a tan sólo 100 km de la ciudad', 'Casa de 300 mts situada en un campo de 32 hectáreas a tan sólo 100 km de Buenos Aires. Hermoso entorno natural con lindas  vistas a quebradas. Se alquila en su totalidad para que disfruten de la aunténtica tranquilidad del campo argentino. Se ofrece tanto para eventos/ día de campo / hotel. Respirar el. campo mirando la puesta de sol o salida de la luna.. Zona Azcuénaga, San Antonio de Areco, San Andrés de Giles. ', NULL, NULL, 5, 2, 0, 280, 30, 0, 0, NULL, 'Buenos Aires', 'San Andres de Giles', 'Argentina', '-59.44724660000001', '-34.4429759', 3000.00, NULL, 'flexible', NULL, 6, 1, 0, '2017-09-20 21:09:08', '2017-10-06 06:56:03', NULL, 1),
