(185, 313, 'Hermoso espacio con juegos en Cañitas', 'Ubicado en el corazón de Cañitas, un polo gastronómico y de bares de la mejor calidad. Un gran salón con un espacio distendido, una propuesta de estilo único ideal para reuniones o cenas. Donde podés compartir experiencias con los metegoles, jengas gigantes y una gran variedad de juegos de mesa.  <br />\nEs un lugar multifunción que puede armarse según la necesidad del evento, ya sea mediante sillas y mesas o bien con un estilo de sillones y mesas bajas. <br />\n<br />\nAsimismo, se ofrece catering con Café, Jugo exprimido, Agua y Gaseosa con medialunas por un adicional de $50 por persona. Si se desea otro tipo de comida para lunch o cena, contamos con cocineros y cocina gastronómica a disposición.<br />\nTambién se puede consultar para eventos por el local entero que cuenta con mas de 700m2 y 4 pisos con una capacidad para 500 personas. <br />\n<br />\nZona: Las Cañitas', NULL, NULL, 1, 1, 0, 220, 150, 150, 70, NULL, NULL, NULL, NULL, NULL, NULL, 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-09-23 03:41:15', '2017-09-25 05:53:01', NULL, 0),
(186, 314, 'NAVE y PATIO', 'Nave es un galpón fabril totalmente despejado de columnas y con luz natural de 700 m2 con baños nuevos y cocina equipada. Ideal para realizar eventos sociales, corporativos y producciones musicales y cinematográficas.<br />\nCuenta con estacionamiento propio y cerrado, salón adicional para recepciones y guardarropas.<br />\nAdemás permite realizar el ingreso de catering o equipo técnico por accesos independientes.', NULL, NULL, 2, 8, 0, 700, 300, 350, 280, 'Castelli 150', 'Buenos Aires', 'Tigre', 'Argentina', '-58.56477449999999', '-34.4301392', 5000.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-09-24 18:26:18', '2017-09-24 18:45:47', NULL, 0),
(187, 235, 'Espacio colaborativo y rústico en El Golf', 'Esta espacio tiene tres sectores principales. El primer piso es la recepción y sala de espera con bar de café. El segundo piso es un espacio de trabajo compartido abierto con una variedad de estaciones de trabajo. Este piso también incluye un área para relajarse o para reunirte casualmente con tu equipo o clientes. El tercer piso contiene oficinas privadas, un kitchenette, una sala de reuniones para 6 personas y una cabina telefónica.', NULL, NULL, 2, 4, 0, 100, 50, 50, 25, 'San Sebastián 2909', 'Región Metropolitana', 'Las Condes', 'Chile', '-70.6001816', '-33.41470839999999', 0.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-09-25 19:34:39', '2017-09-25 19:45:46', NULL, 0),
(188, 283, 'Helipuerto con vista 360º', '- HELLO WORLD -<br />\n<br />\nUbicado  en Dique I de Puerto Madero,  este Helipuerto cuenta con la mejores vistas 360° al río y a la ciudad. <br />\n<br />\nSe encuentra situado en el proyecto de usos mixtos más importante del país, en una zona estratégica por sus vistas, accesos y seguridad.<br />\n<br />\nZona: Dique 1, Puerto Madero.', NULL, NULL, 15, 1, 0, 0, 15, 0, 0, 'Camila O''Gorman 412', 'CABA', 'Buenos Aires', 'Argentina', '-58.3609277', '-34.6208688', 50000.00, NULL, 'estricto', NULL, 6, 1, 0, '2017-09-25 20:20:39', '2017-09-30 01:38:21', NULL, 1),
