(193, 317, 'Salon Camargo', 'El Salon Camargo es un espacio único en Buenos Aires de 18x9 metros y 6 metros de altura. Con piso de madera eslovena maciza plastificada, aislada con cámara de aire de 20 cm, especialmente diseñada para lograr un efecto elástico, ideal para seminarios de Danza, Yoga o Artes Marciales. Equipada con consola y parlantes potenciados, aire acondicionado y calefacción. Contamos ademas con recepcion, amplios vestuarios, cocina y sala de espera.<br />\nAlgunos de nuestros clientes:  Casting y rodajes: Body Language Film (Holanda),  Landia, Metropolis Films, Huinca cine,Utopica Group, Dani Umpi /Seminarios Internacionales:  Andrew Harwood, David Zambrano, Peter Jasko, ,  Eduardo Fukushima, , Eckhard Muller, Kara Wenham, Chicho Frumboli, Lino Miele, etc. / Ensayos : Compañia M!longa Sidi Larbi Cherkaoui, Breaking Tango / Club 69, etc<br />\nZona: Villa Crespo, CABA<br />\n', NULL, NULL, 2, 5, 0, 162, 250, 250, 250, 'Camargo 231', 'CABA', 'Buenos Aires', 'Argentina', '-58.4379897', '-34.6027551', 0.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-09-26 22:32:18', '2017-09-26 23:46:01', NULL, 0),
