(197, 322, 'Un Oasis en el Soho', 'Este estimulante y creativo espacio ubicado en el artístico barrio de Palermo está compuesto por un<br />\nelegante lounge, una terraza, dos bares, una pileta y un maravilloso jardín. Ideal para los bon vivants<br />\ny los buscadores de sensaciones.<br />\n<br />\nZona: Palermo<br />\n<br />\n*Descuentos en temporada baja y lunes.', NULL, NULL, 4, 3, 0, 0, 180, 180, 85, 'Costa Rica 4651', 'CABA', 'Buenos Aires', 'Argentina', '-58.4266841', '-34.5883853', 7000.00, NULL, 'moderado', NULL, 6, 1, 0, '2017-10-01 03:53:13', '2017-10-01 21:32:28', NULL, 1),
