(199, 323, 'Sala de eventos moderna en el corazón de Vitacura', 'Moderno y amplio espacio para realizar eventos desde tipo cocktail hasta conferencias. Espacio flexible para ambientar de cualquier forma.<br />\n<br />\nZona: Vitacura<br />\n<br />\n*Descuento preferencial para clientes del espacio. Cada evento se evalúa y se cotiza. Los valores son referenciales.', NULL, NULL, 1, 6, 0, 100, 80, 80, 60, 'Los Abedules 3085', 'Región Metropolitana', 'Vitacura', 'Chile', '-70.59988249999999', '-33.4062032', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-01 22:05:52', '2017-10-01 23:00:07', NULL, 0),
(200, 268, 'Bar  coffee', '', NULL, NULL, 2, 1, 0, 80, 80, 80, 90, '234 Avenida Córdoba', 'CABA', 'Buenos Aires', 'Argentina', NULL, NULL, 200.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-10-02 16:18:04', '2017-10-02 16:40:43', NULL, 0),
(201, 325, 'Loft de Artista', 'Un PH reciclado con Amor, Arte y Diseño! <br />\nTechos a 6mts con bovedillas curvas, pisos combinados de cemento alisado y pinotea. Amplio y con aberturas de madera recuperada. LUZ NATURAL por doquier. Living Comedor (espacio Multiuso) de 7mx5m anexable por portón levadizo a Estudio de 6m x 4m. Cocina separable o integrada. Patios y acceso a terraza de 10 x 5 mts.<br />\n<br />\nZona: San Nicolás', NULL, NULL, 4, 1, 0, 150, 50, 60, 25, 'Teniente General Juan Domingo Perón 2125', 'CABA', 'Buenos Aires', 'Argentina', '-58.39685600000001', '-34.6071646', 0.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-10-02 18:50:07', '2017-10-09 04:01:19', NULL, 0),
