(207, 287, 'Galería moderna y armónica', 'Es una plataforma de aproximadamente 615 m2 cubiertos / semicubiertos,  con una infraestructura que abarca salas de exposición polivalentes / un área de coffee bar / y un pro shop de productos de diseño. La edificación posee una impronta estética muy contemporánea y limpia. Como materiales protagonistas, conviven en perfecta armonía la madera, el hierro, y las transparencias.<br />\n<br />\nZona: Tigre, a unas pocas cuadras del centro.<br />\n', NULL, NULL, 5, 3, 0, 0, 150, 150, 150, '937 Aníbal González', 'Buenos Aires', 'Rincón de Milberg', 'Argentina', '-58.5914757', '-34.4185263', 1000.00, NULL, 'flexible', NULL, 6, 1, 0, '2017-10-05 20:54:17', '2017-10-06 20:49:02', NULL, 1),
(208, 8, '', '', NULL, NULL, 0, 2, 0, 0, 20, 20, 20, 'Carlos Antonio López 3672', 'CABA', 'Buenos Aires', 'Argentina', '-58.5129878', '-34.5918495', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-07 17:37:54', '2017-10-07 17:49:02', NULL, 0),
(209, 9, 'Pasaje Santamarina, impecable para filmaciones', 'Locación única para filmación y todo tipo de rodaje en el histórico barrio de  San Telmo. Sus muebles antiguos, refaccionados y estéticos brindan una sensación de calidez a todo invitado que ingresa. Su biblioteca rústica perteneciente a una pulpería resignifica el living y comedor principal.<br />\n<br />\nZona: San Telmo<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.<br />\n', NULL, NULL, 6, 3, 0, 250, 30, 30, 15, 'México 756', 'CABA', 'Buenos Aires', 'Argentina', '-58.37684239999999', '-34.6150948', 0.00, NULL, 'moderado', NULL, 3, 1, 0, '2017-10-09 04:47:08', '2017-11-05 20:40:24', NULL, 1),
(210, 337, '1507590081982', '', NULL, NULL, 4, 4, 0, 0, 200, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0.00, NULL, NULL, NULL, 2, 1, 0, '2017-10-10 02:05:35', '2017-10-10 04:26:52', NULL, 0),
(211, 337, 'Finca El Pasante', 'A solo 30 km de la Ciudad Autónoma de Buenos Aires, se encuentra Finca El Pasante. Una casa de campo en una hectárea de parque para disfrutar a pleno de la naturaleza.<br />\n<br />\nContamos con quincho, pilera, solarium, parrillas, asadores, horno de barro.<br />\n<br />\nAllí viven los caseros, que están a disposición de los huéspedes las 24 horas.<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n<br />\n', NULL, NULL, 4, 4, 0, 0, 200, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0.00, NULL, 'estricto', NULL, 4, 1, 0, '2017-10-10 20:54:32', '2017-10-11 00:43:35', NULL, 0),
(212, 338, 'Luz natural y excelente ubicación', 'Es un ambiente amplio, de paredes blancas, techos altos y mucha luz natural. <br />\nEs un primer piso con acceso por escalera, tiene dos ventanales con balcón a la calle.<br />\nContamos con aire acondicionado, proyector y pantalla gigante.<br />\n<br />\nZona: Caballito.', NULL, NULL, 1, 2, 0, 120, 80, 70, 60, 'Avenida Avellaneda 1032', 'CABA', 'Buenos Aires', 'Argentina', '-58.4451885', '-34.6172349', 1000.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-10-11 01:28:06', '2017-10-11 01:51:28', NULL, 0),
(213, 340, '1507714447174', '', NULL, NULL, 2, 2, 0, 4, 50, 60, 45, 'Pico 3102', 'CABA', 'Buenos Aires', 'Argentina', '-58.4809819', '-34.5430359', 0.00, NULL, NULL, NULL, 2, 1, 0, '2017-10-11 12:33:55', '2017-10-11 12:37:31', NULL, 0),
(214, 341, '1507739820556', '', NULL, NULL, 2, 3, 0, 24, 10, 0, 5, 'Avenida Italia 850', 'Región Metropolitana', 'Providencia', 'Chile', '-70.62585310000001', '-33.4425518', 0.00, NULL, NULL, NULL, 2, 1, 0, '2017-10-11 19:29:53', '2017-10-11 19:32:39', NULL, 0),
(215, 221, 'Goleta Clasica 1940', 'Embarcación de antaño. Construida en Buenos Aires y botada en el  año1940, única en su tipo. Ideal para realizar algún cocktail original y diferente recorriendo las islas del Delta o navegando el Rio de la Plata. Necesitas una locación increíble para tu comercial y/o producción de modas, aquí tienen un icono entre la flota de veleros en Buenos Aires.', NULL, NULL, 1, 2, 0, 0, 18, 18, 0, NULL, 'Buenos Aires', 'San Isidro', 'Argentina', '-58.5286102', '-34.470829', 5000.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-12 15:29:52', '2017-10-12 16:02:28', NULL, 0),
(216, 221, 'Amplio Yacht, Vive una Experiencia Unica', 'Crucero muy amplio y comodo para que realices tu fiesta de fin de año corporativa, ideal para cocktails y disfrutar de un día navegando por las islas del Delta. Tienen la posibilidad de contratar un servicio de catering a bordo o recalar en algún restoran/parador de las islas. Cumpleaños, Casamientos. Todo tipo de fiestas y eventos. Si lo desean proveemos actividades de ski & wakeboard, spa onboard, barra de tragos, etc.', NULL, NULL, 1, 4, 0, 0, 60, 60, 0, NULL, 'Buenos Aires', 'San Fernando', 'Argentina', '-58.55796429999999', '-34.4430618', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-12 16:05:36', '2017-10-12 16:12:59', NULL, 0),
(217, 221, 'Yacht VIP - Experiencias a bordo', 'Disfruta de una experiencia inolvidable a bordo de una embarcación moderna & Premium. <br />\nRealizamos recorridos por las islas del Delta y Rio de la Plata. Partimos desde San Isidro o desde Puerto Madero (costo adicional). Ideal para grupos exclusivos. Traslados a Camelo y Colonia, Uruguay. Puedes servir un catering a bordo y barra de tragos. Actividades de Ski & Wakeboard, Spa on board, etc. Navega tu propio rumbo.', NULL, NULL, 0, 2, 0, 0, 20, 20, 0, NULL, 'Buenos Aires', 'San Isidro', 'Argentina', '-58.5286102', '-34.470829', 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-12 16:13:25', '2017-10-12 16:18:18', NULL, 0),
(218, 221, 'Experiencias en Velero para tu equipo de trabajo', 'Partimos desde Puerto Madero para navegar por el Río de la Plata frente la Ciudad de Buenos Aires y Costanera Norte. Contamos con escapadas a Colonia de 2 días y excursiones al Delta. <br />\nLa idea es simple, ustedes deben hacerse cargo de la embarcación. de timonear y maniobrar las velas con la ayuda del capitán en la medida que resulte necesario. ', NULL, NULL, 1, 1, 0, 0, 7, 7, 7, NULL, 'CABA', 'Buenos Aires', 'Argentina', NULL, NULL, 0.00, NULL, 'flexible', NULL, 4, 1, 0, '2017-10-12 16:19:06', '2017-10-12 16:26:36', NULL, 0),
(219, 221, 'Experiencias Corporativas en Veleros', 'Realizamos experiencias para tu equipo de trabajo. <br />\nActividades de Team Building, Incentivo, Integración, Relacionamiento clientes/proveedores. Liderazgo, Comunicación, Adaptación al Cambio. <br />\nDesde 1 hasta 60 embarcaciones. La idea es simple, armanos tripulaciones de 5/6 personas y serán ustedes los encargados de timonear y maniobras las velas con la asistencia del capitán en lo que resultara necesario. Cada uno de los participantes tendrá un rol y estos irán rotando durante toda la actividad.', NULL, NULL, 1, 1, 0, 0, 300, 0, 0, NULL, 'CABA', 'Buenos Aires', 'Argentina', '-58.3620561', '-34.6177194', 0.00, NULL, 'moderado', NULL, 4, 1, 0, '2017-10-12 16:26:59', '2017-10-12 16:34:34', NULL, 0);
