(80, 38, 9, 'Hola Alejandro! \nMe llamo Santi y quiero realizar un ciclo de cine en tu hogar. Serán aproximadamente 10 personas y queríamos hacer una picada después de la proyección.\nGracias.', 1, 1, '2017-08-03 05:02:04', NULL),
(81, 39, 129, 'Vamos a ser 15 invitad os. Podes hacer un descuento ', 1, 1, '2017-08-03 21:25:51', NULL),
(82, 39, 8, 'Si lo reservas hoy te lo dejo en 800. Te mando una propuesta', 1, 1, '2017-08-03 21:31:27', '2017-08-03 21:31:27'),
(83, 39, 1, 'El dueño del espacio envio una propuesta para el evento.', 1, 1, '2017-08-03 21:33:06', '2017-08-03 21:33:06'),
(84, 40, 9, 'Hola!\nComo estas?\nMe comunico con vos porque quiero realizar un taller de cine para 10 personas.', 1, 1, '2017-08-04 20:13:29', NULL),
(85, 41, 9, 'Buenas tardes! estoy buscando una sala para realizar una reunión corporativa con15 personas aprox donde podamos proyectar y tener un espacio privado por 3 horas. Me gustó la locación y quería saber si cuentan con ese espacio y por donde están. La fecha todavía no la tengo\nGracias!', 1, 1, '2017-08-05 01:07:00', '2017-10-23 04:02:06'),
(86, 42, 131, 'Hola, mi nombre es Eloisa y estaba buscando un lugar al aire libre para festejar mi cumpleaños a la noche. Cumplo 20 años y me gustaria invitar a unos amigos a tomar unas cervezas un sabado a la noche, a divertirnos escuchar musica y bailar. \nEsto es posible en su espacio?\nsaludos\neloisa', 1, 1, '2017-08-07 18:06:05', '2017-10-23 04:09:01'),
(87, 43, 135, 'Buenas, queria contrar el espacio para un evento de 90 personas. Me gustaria saber si la gastronomia es del lugar o hay que llevar y hasta que horario esta disponible el mismo. majo', 1, 1, '2017-08-08 21:54:58', '2017-10-23 04:09:47'),
(88, 44, 135, 'Esto es una prueba Ale, ignorala', 1, 1, '2017-10-15 21:55:35', '2017-10-23 04:03:04'),
(89, 45, 135, 'Hola quisiera averiguar cual era el fee y cuales eran las fechas disponibles para rentar el espacio por una jornada completa. \nEl número de personas es indefinido aún pero serán al rededor de 20', 1, 1, '2017-08-08 21:57:01', NULL),
(90, 45, 75, 'Hola Cami, como estás? muchas gracias por tu consulta\nAgosto se encuentra disponible salvo por la semana del 23 al 30, Septiembre se encuentra disponible la primera quincena.  Si se trata de una producción  con 20 personas la jornada completa (8hs) es de 12000 \nSaludos Rocío', 1, 1, '2017-08-08 22:31:12', '2017-08-08 22:31:12'),
(91, 45, 75, 'Esto es una prueba ignorar dasdas.', 1, 1, '2017-08-08 22:31:13', '2017-10-23 04:13:53'),
(92, 44, 9, 'Hola Cami!\nCómo estás?\nPor el momento está disponible esta semana y la próxima.\nEl valor por hora es $1.600 y se alquila un mínimo de 6 hs.\nPero me gustaría entender un poco más que es lo quieren realizar, ya que el máximo que suelo ofrecerlo es para 15 personas, por un tema de comodidad.\ny Si precisarían mover todos los muebles.\nAguardo tu respuesta.\n', 1, 1, '2017-08-08 22:35:07', '2017-08-08 22:35:07'),
(93, 46, 161, 'Hola!\nSoy productora de Pogo, queriamos usar la locacion para el lookbook ss18 de la marca Maria Dahn el 23/08, somos 20 personas, el catering va a estar toda la jornada.\nde 8/9 a 19 hs aprox\n\nmi telefono es 11 6 416 8955 \n\ngracias!\n\nCeci', 1, 1, '2017-08-14 22:22:26', NULL),
(94, 47, 162, 'Hola, mi nombre es Sabrina y les escribo desde la productora Unlimited. \nSomos una productora la cual se dedica principalmente a realizar producciones de contenido para productos móviles. Nos gustó mucho esta casa para hacer una producción con lenceria elegante del tipo de Jesus Fernandez y queria saber saber si la casa esta libre el jueves 24 y si se puede usar toda la casa.\n\nEspero su respuesta y que podamos trabajar juntos!!!\nSaludos y gracias.', 1, 1, '2017-08-14 23:47:20', NULL),
(95, 48, 8, 'Hola Fede,\nIgnorá este mensaje es una prueba, pero si tenes un segundo respondelo para ver si llega tu respuesta.\nSaludos', 1, 1, '2017-08-16 19:55:45', NULL),
