El lugar ofrece sonido regulable y música ambiental, luces dimerizables y lámparas, dos proyectores con pantallas, sofás, sillones, sillas y mesas. Ambiente climatizado, wifi y tv digital, así como un responsable de sala presente durante todo el evento y personal de limpieza. <br />\n<br />\nZona: San Telmo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\nNo se encuentra incluido costo del menú, packs, de vino, barra, mobiliario adicional.<br />\nPrecisan de un cheque de caución en caso de producciones en concepto de posibles daños o rupturas, que se regresa al finalizar el rodaje.', NULL, NULL, 3, 4, 0, 0, 150, 150, 90, '273 Defensa', 'CABA', 'Buenos Aires', 'Argentina', '-58.37200869999999', '-34.6109877', 0.00, NULL, 'estricto', NULL, 6, 14, 0, '2017-05-26 18:34:23', '2017-08-17 21:59:43', NULL, 1),
(45, 20, 'Realismo Mágico en restaurant industrial', 'Este lugar es ideal para realizar producciones, pop ups, exposiciones de arte y demás eventos íntimos por la riqueza de su decoración, producto de la mezcla entre el concepto industrial y vintage. Sus paredes de ladrillos descubiertos y sus objetos de colección generan una atmósfera única, que se complementa con la iluminación tenue e íntima. El propietario genera atmósferas irrepetibles a través de su realismo mágico.<br />\n<br />\nZona: San Telmo<br />\n<br />\n*Producciones sin autos. Si se llegan a utilizar tienen un adicional al precio.<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.', NULL, NULL, 4, 2, 0, 0, 100, 100, 50, 'Avenida Caseros 461', 'CABA', 'Buenos Aires', 'Argentina', '-58.37190529999999', '-34.6266377', 0.00, NULL, 'moderado', NULL, 6, 22, 0, '2017-05-26 20:16:53', '2017-07-25 00:03:44', NULL, 1),
(46, 20, 'Majestuoso galpón, rodeado de objetos únicos', 'Este espacio industrial es ideal para realizar producciones, pop ups, exposiciones de arte y demás eventos íntimos por la riqueza de su decoración, producto de la mezcla entre el concepto industrial y vintage. Sus paredes de ladrillos descubiertos y sus objetos de colección generan una atmósfera única, que se complementa con la iluminación tenue e íntima. El propietario genera atmósferas irrepetibles a través de su realismo mágico.<br />\n<br />\nZona: San Telmo<br />\n<br />\n-Producciones con un auto incluido.<br />\n<br />\n-Los valores expresados son en alquiler privado, existe posibilidad de alquiler parcial. <br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.', NULL, NULL, 8, 2, 0, 2000, 350, 350, 180, 'Avenida Caseros 461', 'CABA', 'Buenos Aires', 'Argentina', '-58.37190529999999', '-34.6266377', 0.00, NULL, 'moderado', NULL, 6, 45, 0, '2017-05-27 08:52:56', '2017-07-25 00:11:16', NULL, 1),
(47, 227, 'Imponente espacio “Art Noveau” en Microcentro', 'Es un espacio único en su tipo para la realización de eventos. Fue inaugurado el 15 de diciembre de 1915. Bajo el estilo “Art Noveau”, cada detalle ha sido pensado para crear un ambiente de sofisticación y elegancia.<br />\n<br />\nZona: San Nicolás<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.<br />\n<br />\nLos valores expresados son en alquiler privado, existe posibilidad de alquiler parcial. ', NULL, NULL, 4, 2, 0, 1200, 500, 500, 280, 'Florida 164', 'CABA', 'Buenos Aires', 'Argentina', '-58.375134', '-34.606164', 8000.00, NULL, 'estricto', NULL, 6, 51, 0, '2017-05-27 21:22:18', '2017-07-21 20:29:13', NULL, 1),
(48, 22, 'Casa moderna en Benavidez con vista a la laguna', 'Acá Bere tenes que decribir cómo es tu casa. SI queres tener referencias fijate como las describen en airbnb', NULL, NULL, 4, 2, 0, 300, 25, 25, 25, 'Deán Funes 5700', 'Buenos Aires', NULL, 'Argentina', '-58.7187461', '-34.3800388', 15000.00, NULL, 'moderado', NULL, 4, 31, 0, '2017-05-28 21:56:44', '2017-07-16 22:31:19', NULL, 0),
(49, 17, 'Living con luz natural y vista al jardín', 'Living con grandes ventanas que dan vista al jardín. Por la orientación, la iluminación natural es fantástica durante todo el día. Es ideal para una producción audiovisual en el interior e intimidad de una casa de familia joven.', NULL, NULL, 2, 1, 0, 60, 10, 10, 6, 'Rivadavia 1251 Comodoro', 'Buenos Aires', 'Boulogne', 'Argentina', '-58.5789121', '-34.48776410000001', 1000.00, 'https://my.matterport.com/show/?m=WV4rLnUcMfa', 'flexible', NULL, 6, 42, 0, '2017-05-29 15:44:18', '2017-07-24 03:52:50', NULL, 1),
(50, 227, 'El Dancefloor en pleno Microcentro', 'Este lugar cuenta con todo el lujo del temprano siglo veinte, por lo que es único para realizar cualquier tipo de evento. Fue inaugurado en 1915 y se destaca por su sofisticación, elegancia y estilo "Art Noveau", además de ser sumamente espacioso, contar con una pista de baile (vanguardista para su época) y palcos.<br />\n<br />\nZona: San Nicolás<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.', NULL, NULL, 4, 2, 0, 500, 350, 350, 180, 'Florida 164', 'CABA', 'Buenos Aires', 'Argentina', '-58.375134', '-34.606164', 8000.00, NULL, 'estricto', NULL, 6, 25, 0, '2017-05-29 19:35:30', '2017-07-21 20:29:33', NULL, 1),
(51, 227, 'Hermoso teatro clásico, símbolo de la elegancia', 'Este hermoso y amplio teatro ubicado en el barrio de San Nicolás tiene una capacidad para 500 personas. Su interior está compuesto por un gran escenario con telón rojo, una decoración clásica, paredes de color blanco y mobiliario en bordó. Cada detalle ha sido pensado para crear un ambiente de sofisticación y elegancia. Puede aprovecharse su amplio espacio para realizar conferencias, eventos y otros tipos de actividades haciendo uso también de su escenario y de los palcos. Además, cuenta con un servicio de seguridad, guardarropas y un gran servicio de sonido e iluminación.<br />\n<br />\nZona: San Nicolás<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.', NULL, NULL, 4, 2, 0, 700, 500, 500, 250, 'Florida 164', 'CABA', 'Buenos Aires', 'Argentina', '-58.375134', '-34.606164', 8000.00, NULL, 'estricto', NULL, 6, 33, 0, '2017-05-29 20:59:11', '2017-07-21 20:29:50', NULL, 1),
(52, 23, 'Viaje al pasado en antigua casona', 'Esta antigua propiedad que asemeja a un conventillo tiene varios espacios interiores como exteriores. Con sus paredes despintadas, puertas antiguas de gran altura, vidrios de colores en los ventanales y escaleras en forma de caracol, este edificio es un viaje sin escalas al pasado. Es el perfecto escenario para filmaciones, sesiones de fotos, reuniones y pop-ups que busquen un ambiente de antaño y un claro paso del tiempo. Un edificio cuyo diseño y fachada es un personaje en sí mismo.  <br />\n<br />\nZona: Villa Crespo', NULL, NULL, 10, 1, 0, 600, 100, 100, 50, 'Corrientes 6067 Avenida', 'CABA', 'Buenos Aires', 'Argentina', '-58.4463525', '-34.5928684', 0.00, NULL, 'flexible', NULL, 6, 37, 0, '2017-05-31 21:50:11', '2017-07-21 20:38:20', NULL, 1),
(53, 33, 'Ph reciclado bohemio', 'Casa antigua reciclada con patio y terraza. Tiene una cocina amplia, con un comedor y un living con decoración musical. Dos Baños y Dormitorio. Un espacio íntimo y despojado para todo tipo de evento.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\n- No se aceptan producciones televisivas.<br />\n*El presupuesto puede modificar en función de la temporada/ época del año.', NULL, NULL, 3, 2, 0, 0, 20, 20, 10, 'Gorriti 5663', 'CABA', 'Buenos Aires', 'Argentina', '-58.4377702', '-34.584319', 0.00, NULL, 'moderado', NULL, 6, 30, 0, '2017-06-01 00:11:42', '2017-07-21 20:25:08', NULL, 1),
(54, 34, 'Un místico jardín con inigualable estética ', 'El lugar nace en un casa emplazada en Bajo Belgrano con un místico jardín y una inigualable estética. Ofrece la posibilidad de realizar una gran variedad de eventos en una localidad de suma tranquilidad y fácil acceso en medio de la ciudad. Se puede adaptar a cualquier tipo de evento gracias a sus muebles y sus amplios y cómodos espacios.<br />\n<br />\nZona: Belgrano<br />\n<br />\nEl precio no incluye: seguridad, limpieza, daños (se cobrará el 100%) y/o servicios extras<br />\n<br />\n*Los valores expresados se verán reducidos por jornada completa.<br />\n<br />\nPolítica de cancelación pautada y, en caso de haberlos, gastos de organización de muebles, etc.<br />\n', NULL, NULL, 2, 3, 0, 0, 300, 300, 200, 'Ramsay 2424', 'CABA', 'Buenos Aires', 'Argentina', '-58.44254789999999', '-34.54902939999999', 7000.00, NULL, 'flexible', NULL, 6, 26, 0, '2017-06-01 20:53:49', '2017-07-21 20:27:59', NULL, 1),
(55, 35, 'Íntimo y cálido ambiente', 'Este lugar muy bien ubicado en el corazón del barrio de Palermo, cuenta con una acogedora sala de estar muy bien equipada para eventos íntimos. Sus diferentes áreas decoradas con detalles en madera y colores en tonalidades tierra, se conectan a través de un patio interno, lo que le brinda un toque especial y apacible. <br />\n<br />\nEste cómodo e impecable espacio brinda la privacidad justa para realizar eventos sociales, corporativos y cocktails de carácter reservado. Además su fácil acceso brinda un valor agregado a los asistentes.<br />\n<br />\nZona: Palermo<br />\n<br />\n- Incluye hora de armado y desarmado.', NULL, NULL, 4, 2, 0, 0, 30, 30, 15, 'Charcas 5258', 'CABA', 'Buenos Aires', 'Argentina', '-58.43167640000001', '-34.5773839', 0.00, NULL, 'flexible', NULL, 6, 75, 0, '2017-06-03 02:08:58', '2017-07-21 20:25:40', NULL, 1),
(56, 227, 'Versátil y amplio salón en el corazón de Recoleta', 'Esta edificación presenta particularidades arquitectónicas únicas por su dimensión, altura, amplitud y concepción. Se divide en 2 niveles que cuentan con barras, espacios vip y salón privado. <br />\n<br />\nZona: Recoleta<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.', NULL, NULL, 5, 2, 0, 1000, 600, 600, 300, 'Avenida Juan Bautista Alberdi 2501', 'CABA', 'Buenos Aires', 'Argentina', '-58.39279899999999', '-34.5862489', 10000.00, NULL, 'estricto', NULL, 6, 66, 0, '2017-06-03 02:28:32', '2017-07-21 20:30:26', NULL, 1),
(57, 36, 'Casona reciclada con fantástica terraza', 'Casa antigua reciclada en pleno Palermo con sala de reunión, oficinas privadas y compartidas, estudio de foto y video y una terraza a cielo abierto llena de plantas. La ubicación es una de sus principales ventajas: subte a una cuadra, líneas de colectivos muy cerca, estación de tren y varios estacionamientos en los alrededores.<br />\n<br />\nZona: Palermo', NULL, NULL, 3, 1, 0, 110, 40, 40, 25, 'Thames 2409', 'CABA', 'Buenos Aires', 'Argentina', '-58.42276760000001', '-34.5819986', 0.00, NULL, 'moderado', NULL, 6, 67, 0, '2017-06-03 02:54:03', '2017-07-21 20:34:02', NULL, 1),
(58, 37, 'Histórico bodegón con estilo rústico', 'Este bodegón de antaño, ubicado en San Telmo, tiene un ambiente rústico y parece haberse quedado congelado en el tiempo. Cuenta con pisos al estilo de un tablero de ajedrez, paredes aguamarina repletas de cuadros y posters de épocas pasadas, varios ventanales y una hermosa subdivisión hecha con vidrios de colores. Pueden aprovecharse sus amplios espacios, aloja hasta 150 personas, y su atmósfera más relajada para organizar muestras de arte y diversos pop-ups. Además, se permite el uso de caterings externos. <br />\n<br />\nZona: San Telmo', NULL, NULL, 2, 2, 0, 0, 150, 150, 75, 'Bolívar 1778', 'CABA', 'Buenos Aires', 'Argentina', '-58.3721061', '-34.6289904', 0.00, NULL, 'flexible', NULL, 6, 52, 0, '2017-06-03 03:26:25', '2017-07-21 20:40:34', NULL, 1),
(59, 20, 'Espacio inmerso en objetos de colección', 'Este lugar es ideal para realizar producciones, pop ups, exposiciones de arte y demás actividades íntimas por la riqueza de su decoración y objetos de colección, producto de la mezcla entre el concepto industrial y vintage. Sus paredes de ladrillos descubiertos y pisos de madera generan una atmósfera única, que se complementa con la abundante luz natural de la que dispone. <br />\n<br />\nZona: San Telmo<br />\n<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.', NULL, NULL, 3, 0, 0, 0, 20, 20, 10, 'Bethlem 427', 'CABA', 'Buenos Aires', 'Argentina', '-58.3718835', '-34.6202356', 0.00, NULL, 'moderado', NULL, 6, 47, 0, '2017-06-03 03:41:18', '2017-07-25 00:14:56', NULL, 1),
(60, 38, 'Armonioso y práctico espacio  ', 'Este recinto conformado por múltiples secciones privadas muy bien iluminadas, también cuenta con una sala de reuniones bien equipada, y un living cuya colorida decoración brinda una atmósfera cálida, que hace juego con los pisos de parquet que predominan en el lugar.    <br />\n<br />\nDe atmósfera íntima y cordial, con dimensiones y diseño pragmático, las áreas de este ambiente pueden ser empleadas y transformadas para cualquier tipo de reunión, producción artística, pop-up dinner, entre otros.<br />\n<br />\nZona: Lomas de Zamora', NULL, NULL, 5, 2, 0, 150, 50, 50, 20, '458 España', 'Buenos Aires', 'Lomas de Zamora', 'Argentina', '-58.4002672', '-34.7660678', 0.00, NULL, 'moderado', NULL, 6, 31, 0, '2017-06-05 17:34:22', '2017-07-21 20:37:02', NULL, 1),
(61, 39, 'Impecable y amplio salón institucional', 'Este atractivo salón institucional con pisos revestidos de madera e impecables paredes blancas con paneles de pana turquesa se encuentra en el atractivo barrio de Palermo. Cuenta con una capacidad para 100 personas y percheros. El espacio es flexible lo que permite que sea usado tanto para un cocktail corporativo de estilo más formal como para un evento social en un ambiente mucho más relajado. Además, tiene wi-fi y pueden utilizarse caterings externos.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Limpieza del salón NO incluida en caso de eventos con uso de cocina.<br />\n-Precio para sábados +20% <br />\n-En caso de extensión de horas de uso, se fracciona cada hora.<br />\n-Seguridad no incluida.', NULL, NULL, 3, 2, 0, 80, 100, 100, 70, 'José Antonio Cabrera 4625', 'CABA', 'Buenos Aires', 'Argentina', '-58.4283728', '-34.5926183', 2000.00, NULL, 'flexible', NULL, 6, 62, 0, '2017-06-05 18:00:32', '2017-07-21 20:39:34', NULL, 1),
(62, 40, 'Sala multidisciplinaria artística y cultural', 'Con sus paredes llenas de colores y dibujos, la gran diversidad de espacios y su ambiente distendido, este lugar es una gran opción para realizar conferencias, lanzamientos y otro tipo de encuentro a nivel masivo, aprovechando su infraestructura y potencial cultural multidisciplinario.<br />\n<br />\nZona: Villa Crespo<br />\n<br />\n- Incluye hora de armado y desarmado.<br />\nSe cotiza aparte técnica, servicio de catering,  servicio de barra libre, proyector, sonido y puesta de luces, shows en vivo, entre otros. ', NULL, NULL, 2, 2, 0, 0, 350, 350, 170, 'Pringles 1249', 'CABA', 'Buenos Aires', 'Argentina', '-58.426233', '-34.597356', 0.00, NULL, 'estricto', NULL, 6, 38, 0, '2017-06-05 18:35:02', '2017-07-21 20:41:07', NULL, 1),
(63, 41, 'Acogedora casa y atractivo patio', 'Esta casa, ubicada en el barrio de Chacarita, cuenta con un pintoresco patio decorado con varias plantas y pequeños árboles en distintas tonalidades de verde que generan un ambiente cálido. En su interior hay un acogedor living con sillones, mesas y sillas. Sus paredes son blancas pero los cuadros, objetos y decoraciones elegidos le dan el color necesario para crear una atmósfera vibrante. Es un gran sitio para realizar eventos como cocktails sociales y corporativos aprovechando su patio durante el buen clima como también su interior y lograr brindarles a los asistentes un entorno distendido.<br />\n<br />\nZona: Chacarita', NULL, NULL, 4, 2, 0, 0, 45, 45, 20, 'Giribone 947', 'CABA', 'Buenos Aires', 'Argentina', '-58.45615840000001', '-34.5801766', 0.00, NULL, 'moderado', NULL, 6, 54, 0, '2017-06-05 20:58:38', '2017-07-21 20:42:28', NULL, 1),
(64, 39, 'Espacio multidisciplinario artístico', 'Este atractivo salón institucional con pisos revestidos de madera e impecables paredes blancas con paneles de pana turquesa se encuentra en el atractivo barrio de Palermo. Cuenta con una capacidad para 50 personas y percheros. El espacio es flexible lo que permite que sea usado tanto para una clase de yoga como para una reunión descontracté. Además, tiene wi-fi y pueden utilizarse caterings externos.<br />\n<br />\nZona: Palermo<br />\n<br />\n-Limpieza del salón NO incluida en caso de eventos con uso de cocina.<br />\n-Precio para sábados +20% <br />\n-En caso de extensión de horas de uso, se fracciona cada hora.<br />\n-Seguridad no incluida<br />\n', NULL, NULL, 2, 2, 0, 80, 50, 50, 20, 'José Antonio Cabrera 4625', 'CABA', 'Buenos Aires', 'Argentina', '-58.4283728', '-34.5926183', 2000.00, NULL, 'flexible', NULL, 6, 55, 0, '2017-06-05 21:38:42', '2017-07-21 20:39:53', NULL, 1),
(65, 42, 'Hermosa casa antigua bien ubicada', 'Esta casa antigua, con perfecta ubicación de muy fácil acceso, tiene techos altos, grandes ventanales, una buena iluminación natural, pisos de madera, varios balcones y una hermosa escalera perfectamente conservada. Aquí se pueden hacer fiestas con hasta 150 asistentes y usando caterings externos. Es un gran sitio para llevar a cabo sesiones de fotos, filmaciones y otro tipo de eventos, aprovechando la libertad que brindan los amplios salones, la iluminación natural como la perfecta ambientación de la antigua casona en su conjunto. <br />\n<br />\nZona: San Nicolás<br />\n<br />\n-Incluye equipos de sonido, mesas y sillas para 30 personas.', NULL, NULL, 4, 2, 0, 0, 150, 150, 70, 'Avenida Corrientes 2140', 'CABA', 'Buenos Aires', 'Argentina', '-58.3973967', '-34.6046686', 0.00, NULL, 'moderado', NULL, 6, 19, 0, '2017-06-13 14:19:58', '2017-07-21 20:43:05', NULL, 1),
(66, 14, 'Ejemplo', 'use gfurs fguksr gfdr gfudr ghujdr hgu hgkd', NULL, NULL, 2, 2, 0, 300, 50, 30, 0, 'Humboldt 1550', 'CABA', 'Buenos Aires', 'Argentina', '-58.4368656', '-34.5858637', 2000.00, NULL, 'flexible', NULL, 4, 31, 0, '2017-06-14 22:11:37', '2017-06-14 22:15:22', NULL, 0),
(67, 45, '1497645116919', '', NULL, NULL, 0, 0, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0.00, NULL, NULL, NULL, 1, 31, 0, '2017-06-16 23:30:56', '2017-06-16 23:30:56', NULL, 0),
(68, 47, 'Inmaculado estudio con patio', 'Este traslúcido espacio fotográfico, destaca por su simplicidad, excelente disposición e iluminación. Todo esto le otorga la versatilidad suficiente para ser transformado y ambientado a la hora de realizar cualquier tipo de evento. Además cuenta con un delicado y agradable patio. <br />\n<br />\nEstas impolutas y tranquilas instalaciones de paredes blancas y pisos claros tanto en el área interna como en su exterior, cuenta con un toque artístico y brillante que le permite servir de lienzo a la hora de poner en marcha la creatividad, por lo que es ideal para realizar filmaciones, sesiones de fotografía y producciones en general. <br />\n<br />\nZona: Belgrano<br />\n<br />\nAdicionales: <br />\n 5 Flashes Prometh:<br />\n(3) E600w / (1) E800w / (1) HD1200w<br />\n– Peribounce<br />\n– 2 Cajas de luz 90x120cm (con aro adaptador)<br />\n– 1 reflector 5 en 1<br />\n– 1 reflector 7 en 1<br />\n– 4 pies de iluminación<br />\n– 1 Paraguas blanco<br />\n– 1 Paraguas translúcido<br />\n– 1 Paraguas dorado<br />\n– 2 Cacerolas 18cm<br />\n– 2 Cacerola 16cm<br />\n– 1 Mesa de Producto<br />\n– 1 Beauty Dish plateado 70cm<br />\n– 1 Portafondo Portátil<br />\n– 1 Snoot<br />\n– Nido de abeja<br />\n– 2 Backlight<br />\n– 1 Barndoor<br />\n– 1 Juego de filtros 7 colores<br />\n– 1 Jirafa con manija<br />\n– 3 Fondos (blanco – negro – gris)<br />\n– No se cobra el metro pisado –<br />\n– 1 Fotómetro SEKONIC<br />\n– 1 Transmisor<br />\n– 4 Receptores<br />\n', NULL, NULL, 3, 2, 0, 0, 60, 60, 30, 'Avenida Federico Lacroze 2120', 'CABA', 'Buenos Aires', 'Argentina', '-58.44229439999999', '-34.5674579', 0.00, NULL, 'moderado', NULL, 6, 13, 0, '2017-06-22 01:56:39', '2017-07-21 20:43:37', NULL, 1),
(69, 48, 'Espacio multimedial listo para contar tu historia', 'Este edificio cuenta con seis áreas bien definidas entre sí, cada una con su propio concepto, estética y comodidades. Este espacio ofrece múltiples alternativas en sus 5.000m2 cubiertos y sus 2.000m2 de terrazas equipadas. Su minimalismo, su variedad de espacios y la flexibilidad del lugar ofrece una gran libertad a la hora de delimitar sectores y aprovechar su tamaño para llevar a cabo conferencias, reuniones, workshops, entre otras actividades. Además, cuenta con wi-fi, baños y ascensor y se aceptan caterings externos.<br />\n<br />\nEl Estudio I es una planta de 900m2, con una altura de 17m<br />\nParrilla operable en toda la superficie a 12m de la base<br />\nSala de vestuario / Sala de maquillaje y pelo / Bar/ Comedor + cocina industrial<br />\nIngreso de vehículos en el set mediante entrada de camión con dársena de descarga para pala hidráulica<br />\nTecho corredizo para ingreso de luz natural<br />\nBar/barra / Comedor + cocina industrial<br />\n4 baños y duchas en la planta del estudio / Baños públicos con gabinete de seguridad<br />\nEspacio de living con Wi-Fi / Acceso a patio 200m2 para expansión <br />\nEspacio interno y cubierto para generador<br />\n<br />\nZona: Villa Crespo', NULL, NULL, 0, 4, 0, 900, 500, 500, 400, 'Cucha Cucha 1661', 'CABA', 'Buenos Aires', 'Argentina', '-58.45482879999999', '-34.60387290000001', 0.00, NULL, 'moderado', NULL, 6, 7, 0, '2017-06-22 03:11:55', '2017-07-21 20:44:10', NULL, 1),
(70, 48, 'Espacio industrial artístico y versátil', 'Espacio de 400 m2 con techo de vidrio que permite el ingreso de luz natural. Cuenta con tres accesos, dos escaleras y un montacargas.<br />\nSu minimalismo y flexibilidad ofrece una gran libertad a la hora de delimitar sectores y aprovechar su tamaño para llevar a cabo producciones, eventos, entre otras actividades. <br />\nRecepción y entrada independiente / Sala de vestuario / Sala de maquillaje y pelo / Cocina y comedor / 2 baños con ducha <br />\n<br />\nZona: Villa Crespo', NULL, NULL, 0, 2, 0, 250, 60, 60, 40, 'Cucha Cucha 1661', 'CABA', 'Buenos Aires', 'Argentina', '-58.45482879999999', '-34.60387290000001', 0.00, NULL, 'moderado', NULL, 6, 34, 0, '2017-06-22 21:59:16', '2017-07-21 20:44:24', NULL, 1),
(73, 48, 'Rooftop versátil y creativo ', 'Su estética brutal, su variedad de espacios, el hormigón a la vista y la flexibilidad del lugar lo que ofrece una gran libertad a la hora de delimitar sectores y aprovechar su tamaño hacen que sea una gran locación para producciones y eventos, entre otras actividades. Además, cuenta con wi-fi, baños y ascensor y se aceptan caterings externos.<br />\nEl rooftop cuenta con Sin fin para producciones fotográficas / Baños / Salón de usos múltiples / Acceso a dos plataformas superiores para imágenes cenitales, en dos niveles.<br />\n<br />\nZona: Villa Crespo', NULL, NULL, 0, 4, 0, 225, 500, 500, 400, 'Cucha Cucha 1661', 'CABA', 'Buenos Aires', 'Argentina', '-58.45482879999999', '-34.60387290000001', 0.00, NULL, 'moderado', NULL, 6, 20, 0, '2017-06-24 02:02:34', '2017-07-21 20:44:46', NULL, 1),
(74, 49, 'Una villa italiana en Buenos Aires', 'Esta réplica de un pueblo de la Toscana italiana con detalles del medioevo europeo mantiene el confort, la seguridad y un estilo único. Con plazas secas de reunión, recovas peatonales, escudos familiares y construcciones que parecen haber sido traídas directamente de Europa, este lugar da la sensación de estar inmerso en un pequeño pueblo. Es un lugar mágico para llevar a cabo todo tipo de encuentros en algunos de sus grandes salones o incluso en su hermosa terraza aprovechando la sensación de estar en congregados en una ciudad italiana.<br />\n<br />\nZona: Benavídez<br />\n<br />\nEl valor expresado en el caso de Reunión y/o Eventos es sólo por el alquiler del espacio y deberán cotizarse los servicios adicionales obligatorios. Sólo se podrá alquilar el espacio para ambos rubros exclusivamente sin servicios, los fines de semana. <br />\nDepósito de garantía: 50% del valor del arriendo.<br />\n<br />\n*Precio expresado en pesos argentinos, pero supeditado a cotización del dólar en la fecha de reserva.', NULL, NULL, 2, 2, 0, 200, 120, 120, 45, 'Libertad 50', 'Buenos Aires', 'Benavidez', 'Argentina', '-58.73006600000001', '-34.4066275', 0.00, NULL, 'moderado', NULL, 6, 36, 0, '2017-06-24 03:09:22', '2017-07-25 00:32:28', NULL, 1),
(75, 50, 'Imponente salón con estilo propio de campo', 'Una añosa arboleda de eucaliptus y un espejo de agua con fauna autóctona dan marco a una imponente construcción de estilo criollo, especialmente proyectado y diseñado para eventos corporativos o sociales ligados a este entorno tan particular.<br />\nEn una superficie total cubierta de 700 m2 contamos con una recepción, salon principal con doble altura, una gran parrilla cubierta y amplias galerías donde la mirada se pierde sin encontrar su limite.<br />\nLa construcción del salon permite multiples disposiciones, y diferentes tipos de ambientación, con el paisaje de la pampa como escenario principal.<br />\n<br />\nZona: Arrecifes<br />\n<br />\n- Costo aparte: Estadía en la estancia por dos días y una noche hasta 27 personas.<br />\n', NULL, NULL, 2, 6, 0, 700, 400, 400, 250, NULL, 'Buenos Aires', 'Arrecifes', 'Argentina', '-60.1024864', '-34.0591955', 0.00, NULL, 'estricto', NULL, 6, 63, 0, '2017-06-25 04:45:59', '2017-07-21 20:34:42', NULL, 1),
(76, 51, 'Excelente ambiente de desconexión creativa', 'El lugar está dividido en dos íntimos estudios, muy bien equipados, con pisos de madera y decorados con un estilo sobrio que evoca un clima calmo e inspirador. <br />\nA los estudios se suma una amplia área de recreación, cuyas paredes ostentan colores vivos y cuenta con tenis de mesa y pool, expendedora de café, té, microondas y heladera, a disposición de quienes visiten el recinto. <br />\n<br />\nZona: Núñez', NULL, NULL, 2, 2, 0, 0, 35, 35, 20, 'Vidal 3069', 'CABA', 'Buenos Aires', 'Argentina', '-58.46767920000001', '-34.5557001', 0.00, NULL, 'moderado', NULL, 6, 65, 0, '2017-06-25 05:05:41', '2017-07-21 20:37:42', NULL, 1),
(77, 227, 'Amplio y multifuncional Auditorio', 'Recoleta tiene carácter; su imponente cementerio, su Plaza Francia, la Biblioteca Nacional, su<br />\nCentro Cultural Recoleta, en ese mix encantador de diseño se encuentra nuestro Espacio para Eventos. Preparado para llevar adelante cualquier tipo de desafío, el espacio permite modificarse para llevar a cabo todo tipo de evento.<br />\n<br />\nZona: Recoleta<br />\n<br />\n- Incluye hora de armado y desarmado en su jornada completa.<br />\n- Seña no tiene devolución pasado los 20 días de la contratación, queda crédito a favor pudiendo utilizarse hasta dentro de un año o transferida a otra empresas/persona.', NULL, NULL, 5, 2, 0, 2100, 700, 700, 350, 'Avenida Pueyrredón 250', 'CABA', 'Buenos Aires', 'Argentina', '-58.4061069', '-34.6071061', 10000.00, NULL, 'estricto', NULL, 6, 64, 0, '2017-06-25 05:23:16', '2017-07-21 20:30:47', NULL, 1);

